(1, '作为西大万千学子中的一名，希望学生会带领着所有西大人一起，发扬西大“含弘光大，继往开来”的传统，走到梦想的彼岸，筑建独属于我们的辉煌。\\^O^/', 166, 2, 1, '2015-10-03', 0),
