(32, '都说西大是一个孕育爱情的地方，其实在我看来并不然，在缙云嘉陵千百年的滋养下，西大也成为了人才的聚集地，更难得可贵的是涌现了学生会这么一批冲在时代的前沿 敢于并乐于帮助同学的人…西大应该为你们感到自豪…我作为西大的一份子对你们也是抱着尊重敬仰和佩服…因为你们付出的是我们难以想象的…所以希望你们继续努力…将西大壮大', 171, 2, 1, '2015-10-03', 0),
