INSERT INTO `president` (`id`, `president`, `school_id`, `introduce`, `pic`, `praise`, `posization`) VALUES
(2, '胡蕊', 36, '胡蕊，女，2013年进入校学生会。在学生会培训月中，获得“优秀辩手”的称号。独自策划并总负责学院及市民学校“讲故事大赛”。全程参与了“校园歌手大赛”策划，以及整个活动的上下沟通。能够熟练操作常用办公软件word、excel、ppt等，对网络管理有一定了解。有较好的文字写作功底，口头表达能力较强。我喜欢创新，更敢于迎接新挑战。参加重庆市大骨班班培训期间获得“优秀学员”称号”，并参加井冈山第204期社会主义核心价值观培训班。 获得2014年重庆市优秀共青团员和重庆市学生会工作先进个人。做为一名传统的中国大学生', 'http://redrock.u.qiniudn.com/2015-09-28_5608a71121ca5.jpg-tinyq30', '3', '院学生会主席'),
(3, '周广霜', 36, '重要的工作即为完成主席团与各部门的上传下达工作，及时与指导老师沟通，协助主席完成领导安排下来的任务。秘书长的工作就是为了保障整个学生会的顺利运转。同时，秘书长是学生会财务及各类资料的总管。学生会的活动经费及物品多由秘书长备案管理和整理学生会的各类档案。', 'http://redrock.u.qiniudn.com/2015-09-28_5608a7cf434de.jpg-tinyq30', '1', '院学生会秘书长'),
(4, '杜美裁', 36, '我非常热爱在学生会的工作，从第一天走进学生会这一个大家庭，我就时刻以“从同学中来，到同学中去”为自己的奋斗目标，时刻提醒为同学服务才是自己的理念。每一次出去和商家谈赞助，心里都是忐忑的，但一想到为同学们更好的举办活动，咬着牙也冲上去。每次成功的拉回赞助，心里的高兴无法用言语来形容！我为自己是名学生的一员而感到骄傲！为同学付出过的自豪，只有自己体验过才明白！', 'http://redrock.u.qiniudn.com/2015-09-28_5608a7fd0cbd3.jpg-tinyq30', '2', '院学生会副主席'),
(5, '穆承阳', 36, '本人在重庆建筑工程职业学院学生会工作一年，是一个积极向上，有责任，有担当，有上进心，有能力的学生干部，对工作认真负责，兢兢业业，善于沟通，有较强的组织和协调能力。现正在院学生会主席团任职，回忆起学生会，是学生会让我从一个迷茫的大学生转变为一个富有担当与责任心的大学生。回忆起学生会的活动，本人也参与并组织学校各类大型活动如：校园歌手大赛 元旦晚会等。在系上，我是老师的左膀右臂，在班级里，我是同学们的榜样。我积极参加学院各类活动，带领同学们积极参加如：校园篮球赛、拔河比赛跳绳 辩论大赛等活动，都取得了佳绩，得', 'http://redrock.u.qiniudn.com/2015-09-28_5608a83715d1e.png-tinyq30', '3', '院学生会主席团助理'),
(6, '段明婷', 36, '我加入院学生会这个大家庭已经一年，从办公室干事到办公室助理再到主席团助理，，获得优秀学生会干部称号，从最开始的懵懵懂懂到现在的理解热爱，学生会工作让我体会到了团结协作的力量，感受到集体的温暖，在学生会工作中，我提升自己，从胆小不敢说话变得从容大方，变得做事条理清晰，我想为学生会做的更多，把自己变得更好，学生会也将建立得完善，更好的为同学服务', 'http://redrock.u.qiniudn.com/2015-09-28_5608a8b45870d.jpg-tinyq30', '5', '院学生会主席团助理'),
(7, '杨忠谕', 39, '杨忠谕，男，中共预备党员，重庆师范大学涉外商贸学院英语（师范）专业2013级本科生，现任重庆师范大学涉外商贸学院学生会书记。曾被评为重庆市校园之春职场青春一等奖，重庆市合川区优秀志愿工作个人，“挑战杯”全国大学生课外学术科技作品竞赛重庆三等奖等。', '', '0', '重庆师范大学涉外商贸学院学生会书记'),
(8, '王静煊', 39, '王静煊，女，共青团员，重庆师范大学涉外商贸学院表表演（播音与主持艺术）专业2013级本科生，现任重庆师范大学涉外商贸学院学生会主席。曾被评为校级优秀共青团干部 。', '', '0', '重庆师范大学涉外商贸学院学生会主席'),
(9, '吕庚青', 39, '吕庚青，女，共青团员，重庆师范大学涉外商贸学院新闻学专业2013级本科生，现任重庆师范大学涉外商贸学院学生会副书记。曾被评为校优秀共青团干部。', '', '0', '重庆师范大学涉外商贸学院学生会副书记'),
(10, '鲁诗蕾', 39, '鲁诗蕾，女，共青团员，重庆师范大学涉外商贸学院物联网工程（智能交通与车联网）专业2013级本科生，现任重庆师范大学涉外商贸学院学生会副主席。曾被评为校优秀学生干部，校优秀共青团干部。', '', '0', '重庆师范大学涉外商贸学院学生会副主席'),
(11, '汪梅', 39, '汪梅，女，共青团员，重庆师范大学涉外商贸学院汉语言文学（师范）专业2013级本科生，现任重庆师范大学涉外商贸学院副主席兼任志愿者工作部部长。曾被评为校级优秀学生干部、优秀共青团员，精神文明先进个人。', '', '0', '重庆师范大学涉外商贸学院副主席兼任志愿者工作部部长'),
(12, '陈凯', 39, '陈凯，男，共青团员，重庆师范大学涉外商贸学院商务英语（国际经贸）专业2013级本科生，现任重庆师范大学涉外商贸学院学生会副主席兼勤工助学部部长。曾被评为校优秀学生干部。', '', '0', '重庆师范大学涉外商贸学院学生会副主席兼勤工助学部部长'),
(13, '罗洋', 39, '罗洋，男，共青团员，重庆师范大学涉外商贸学院表演（戏剧影视表演）专业2013级本科生，现任重庆师范大学涉外商贸学院学生会副主席兼任社团部部长。曾被评为校优秀学生干部。', '', '0', '重庆师范大学涉外商贸学院学生会副主席兼任社团部部长'),
(14, '王鑫', 40, '王鑫，女，共青团员，重庆工商大学融智学院金融学专业2012级本科生，现任重庆工商大学融智学院学生会副书记。曾被评为重庆市“三下乡”社会实践先进个人，学院2014-2015学年“三等奖学金”，两次获得“优秀团干”的荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608abc813efb.jpg-tinyq30', '0', '重庆工商大学融智学院学生会副书记'),
(15, '李可馨', 40, '李可馨，女，共青团员，重庆工商大学融智学院会计学专业2012级本科生，现任重庆工商大学融智学院学生会主席。曾被评为重庆工商大学融智学院“三下乡”社会实践先进个人、2012-2013学年综合三等奖学金、院级活动“英语歌曲大赛”一等奖、“电影配音大赛”二等奖、“思在杯”辩论赛最佳辩题、并两次获得“优秀团干”的荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608abf946a64.jpg-tinyq30', '0', '重庆工商大学融智学院学生会主席'),
(16, '潘璐敏', 40, '潘璐敏，女，共青团员，重庆工商大学融智学院保险学专业2012级本科生，现任重庆工商大学融智学院院学生会副主席。曾带领团队参加中国人民财产保险公司的比赛获得重庆市优秀奖、获校三下乡优秀社会实践报告“一等奖”、挑战杯全国大学生创业大赛校内竞赛中获得二等奖、获得“优秀团员”、“优秀团干”、“优秀学生干部”等荣誉称号、校运动会中获得优秀裁判称号、个人考取了保险从业资格证书、普通话等级考试二甲、补休心理学与教育学证书，通过AFP金融理财规划师考试获得相应证书。', 'http://redrock.u.qiniudn.com/2015-09-28_5608acfe76f27.jpg-tinyq30', '0', '重庆工商大学融智学院院学生会副主席'),
(17, '张颖辉', 40, '张颖辉，男，共青团员，重庆工商大学融智学院房地产开发与管理专业2012级本科生，现任重庆工商大学融智学院学生会副主席。曾被评为重庆市“三下乡”社会实践先进个人、院级活动“电影配音大赛”二等奖、校运动会中获得优秀裁判称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ad3265ff2.png-tinyq30', '0', '重庆工商大学融智学院学生会副主席'),
(18, '张晓琳', 40, '张晓琳，女，共青团员，重庆工商大学融智学院信用管理专业2012级本科生，现任重庆工商大学融智学院学生会秘书长。曾在中国日报网、中国青年网、中国基层党建网、金羊网、中宣网等网站发表文章；获得重庆市大学生艺术展演征文类三等奖、重庆工商大学融智学院“三下乡”社会实践先进个人、院级活动“微博达人秀”一等奖、“电影配音大赛”二等奖、“融智之星—文学之星”、并两次获得院级“优秀团干”的荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ad654a7a6.jpg-tinyq30', '0', '重庆工商大学融智学院学生会秘书长'),
(19, '于富强', 43, '于富强，男，预备党员，重庆邮电大学移通学院通信工程专业2013级本科生，现任重庆邮电大学移通学院校学生会主席。曾被获“重庆邮电大学移通学院第二届第二任校级学生组织优秀干事”、“重庆邮电大学移通学院第二届第三任校级学生组织优秀干部”等称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ae364e25c.JPG-tinyq30', '0', '重庆邮电大学移通学院校学生会主席'),
(20, '曹梦媛', 43, '曹梦媛，女，共青团员，重庆邮电大学移通学院工商管理专业2013级本科生，现任重庆邮电大学移通学院校学生会副主席。曾被评为第二届第二任校级学生组织优秀干事、第二届第三任校级学生组织优秀干部等称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ae5e45b14.jpg-tinyq30', '0', '重庆邮电大学移通学院校学生会副主席'),
(21, '安聪', 43, '安聪，女，共青团员，重庆邮电大学移通学院物联网工程专业2013级本科生，现任重庆邮电大学移通学院校学生会副主席。曾被评为第二届第三任校级学生组织优秀干部、学习进步先进个人，多次被评为团学工作先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ae86c393a.jpg-tinyq30', '0', '重庆邮电大学移通学院校学生会副主席'),
(22, '徐涛辰', 45, '徐涛辰，男，共青团员，重庆工程学院软件工程专业2014级本科生，现任校学生会副主席。曾被评为校级“优秀团员”，校级“优秀团干部”，获得首届“文化艺术节、文明修身节”杰出贡献奖，首届“体育健身节”杰出贡献奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608af05e4187.jpg-tinyq30', '0', '重庆工程学院学生会副主席'),
(23, '蒋昊', 45, '蒋昊，男，共青团员，重庆工程学院物联网工程专业2014级本科生，现任校学生会副主席。曾被评为校级“优秀团员”，校级“优秀团干部”，获得首届“文化艺术节、文明修身节”杰出贡献奖，首届“体育健身节”杰出贡献奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608af30128ae.jpg-tinyq30', '0', '重庆工程学院院学生会副主席'),
(24, '陈云华', 46, '陈云华，男，中共预备党员，重庆信息技术职业学院装潢艺术设计专业2013级专科生，现任重庆信息技术职业学院校团委副书记。曾被评为重庆市“三下乡”社会实践先进个人、、重庆信息技术职业学院“优秀青年志愿者”、“优秀学生干部”、奉节县青少年“书信大赛”一等奖、奉节县中小学生暑期社会实践“先进个人”等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608aff07a9ae.jpg-tinyq30', '0', '重庆信息技术职业学院校团委副书记'),
(25, '谭有涛', 46, '谭有涛，男，共青团员，重庆信息技术职业学院电子专业2013级大专生，现任重庆信息技术职业学院学生会主席。曾被评为重庆信息技术职业学院2013—2014年度三好学生、2014—2015年度三好学生。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b05fd837e.JPG-tinyq30', '0', '重庆信息技术职业学院学生会主席'),
(26, '胡海燕', 46, '胡海燕，女，共青团员，重庆信息技术职业学院计算机辅助设计与制造专业2014级专科生，现任重庆信息技术职业学院校团委副书记助理兼新闻中心主任。曾被评为重庆信息技术职业学院校团委2014-2015年度优秀干事、《新点子策划大赛》第三名、重庆信息技术职业学院自立自强先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b09e0f6cc.JPG-tinyq30', '0', '重庆信息技术职业学院校团委副书记助理兼新闻中心主任'),
(28, '李炀', 46, '李炀，男，共青团员，重庆信息技术职业学院移动通信技术专业2014级专科生，现任重庆信息技术职业学院学生会副主席兼社团活动中心主任。曾被评为重庆信息技术职业学院校团委2014-2015年度三好学生、优秀青年志愿者。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b14031f1e.JPG-tinyq30', '0', '重庆信息技术职业学院学生会副主席兼社团活动中心主任'),
(29, '淳丽琨', 46, '淳丽琨，女，共青团员，重庆信息技术职业学院广告设计与制作专业2014级专科生，现任重庆信息技术职业学院学生会副主席兼外联部部长。曾被评为重庆信息技术职业学院校团委2014-2015学年度被评为“优秀干事”、“优秀社长”。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b16f288cc.JPG-tinyq30', '0', '重庆信息技术职业学院学生会副主席兼外联部部长'),
(30, '邬代明', 46, '邬代明，男，共青团员，重庆信息技术职业学院计算机辅助设计与制造专业2014级专科生，现任重庆信息技术职业学院校团委办公室主任。曾被评为重庆信息技术职业学院校团委2014-2015年度优秀干事、优秀共青团员。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b1d10dd0b.JPG-tinyq30', '0', '重庆信息技术职业学院校团委办公室主任'),
(31, '朱琳', 50, '朱琳，女，共青团员，重庆传媒职业学院新闻系传媒策划与管理专业2013级专科生，现任重庆传媒学院学生会主席。曾在2013年被评校优秀学生干事、三好学生，2014年被评三好学生、优秀学生干部，2015年被评技能大赛优秀奖等。在学生会这两年里参加了校外实践活动有：自愿者敬老院活动、三下乡活动、牡丹园开园活动等。在校内参加和组织的活动有：迎新晚会、五四红歌比赛、运动会、校园之春歌手大赛等各大大小小活动。', '', '1', '重庆传媒学院学生会主席'),
(32, '王艺多', 50, '王艺多，女，共青团员，重庆传媒职业学院影视系电视节目制作专业2014级专科生，现任重庆传媒学院学生会副主席。曾获得2010年西昌美术节优秀奖、2011年荣获三等奖学金、2013三好学生、优秀学生干部、2014年九月获学院“军训标兵”、2014年加入学生会成为干事、2015年获优秀学生干事。在实践活动中参与西昌火把节成为荣誉志愿者、参与成都舞蹈大赛、参与牡丹园活动成为志愿者和参与学校大大小小各项活动。', '', '0', '重庆传媒学院学生会副主席'),
(33, '伍丹丹', 50, '伍丹丹，女，共青团员，重庆传媒职业学院新闻系传媒策划与管理专业2014级专科生，现任重庆传媒学院学生会副。曾获得2012曾被评为优秀班干、优秀社团干部、2013曾被评为优秀社团联合会干部、2014年九月获学院“军训标兵”。在实践活动中参加了学校各大小型活动。', '', '0', '重庆传媒学院学生会副主席'),
(34, '周健', 50, '周健，男，共青团员，重庆传媒职业学院艺术系室内设计专业2014级专科生，现任重庆传媒学院学生会副主席。曾获得2012年获铜梁县第十六届艺术暨比赛一等奖、2013年第五届春季运动会获男子跳远第一名、2014年九月获学院“军训标兵”、4014年获重庆市第四届大学生艺术展演活动一等奖、2014年加入学生会成为体育部干事。在实践活动中参与重庆市大学生艺术展活动、参与重庆市大学生创业培训、参与牡丹园活动成为志愿者和学校各大大小小活动。', '', '0', '重庆传媒学院学生会副主席'),
(35, '罗洪生', 53, '罗洪生  男，共青团员，重庆交通职业学院建筑工程技术2014级学生。现任重庆交通职业学院学生会主席，曾获得2014年度优秀共青团干部荣誉称号、获得“优秀干事”荣誉称号、在2014年学院技能大赛混凝土强度大赛中获得第一名、两次代表学校外出参加市级比赛（重庆市2015大学生田径运动会、重庆市黑山谷大学生越野赛）、校运动会中获得男子800米第二名、在2014年读书月活动中获得优秀奖、在校冬季长跑活动中获得第五名、在第六届”迎新杯“篮球赛中获得团体第三名。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b354a6f34.jpg-tinyq30', '15', '重庆交通职业学院学生会主席'),
(36, '秦朗', 53, '秦朗、男、共青团员、重庆交通职业学院建筑工程技术专业2014级。现任重庆交通职业学院学生会副主席，在班级中担任班长及辅导员助理。曾多次参加志愿者活动及社会实践活动。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b37d4da0f.jpg-tinyq30', '9', '重庆交通职业学院学生会副主席'),
(37, '郑博文', 53, '郑博文，男，共青团员，重庆交通职业学院道路桥梁工程造价2014级学生，现任重庆交通职业学院学生会副主席。曾获得2014级新生军训“标兵”称号、曾多次参与志愿者活动，在班级担任团支部书记。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b3a584210.jpg-tinyq30', '8', '重庆交通职业学院学生会副主席'),
(38, '杨恩', 53, '杨恩，男，共青团员，现任重庆交通职业学院学生第二副书记。曾被评为优秀团员干部、军训优秀学员标兵、学生会优秀工作者，曾获重庆交通职业学院车辆工程系第四届模拟招聘会第二名、第一届诚信考试演讲比赛第一名。曾参加中共沿河土家族自治县共产主义青年团第18届代表大会，并获中共沿河土家族自治县共青团委员会候选人（草案）提名。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b3d9bdd2c.jpg-tinyq30', '10', '重庆交通职业学院学生第二副书记'),
(39, '罗中军', 53, '罗中军  男，共青团员，重庆交通职业学院建筑工程技术专业2014级学生，现任重庆交通职业学院学生第一副书记。 曾获得学院第六届校园文化艺术节“青春梦想汇”个人风采大赛建筑系“第一名”学院“优秀奖”荣誉称号；获得2014-2015学年第一期学院“优秀学生” 荣誉称号；获得2014-2015学年系部“优秀团干部”荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b40214679.jpg-tinyq30', '5', '重庆交通职业学院学生第一副书记'),
(40, '李爽', 53, '李爽，女，共青团员，重庆交通职业学院城市交通运输专业2014级学生，现任重庆交通职业学院学生会副主席，曾被评为城市交通运输协会先进个人，学院第六届阳光杯足球赛迎新杯篮球赛优秀组织工作者，学院第八届技能大赛第二名，学院春季田径运动会400米跳远第二名。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b4387cd58.jpg-tinyq30', '11', '重庆交通职业学院学生会副主席'),
(41, '王昕梓', 53, '王昕梓、男、共青团员，重庆交通职业学院建筑工程造价2014学生。现任重庆交通职业学院学生会副主席。曾获得；贵州第27届科技创新大赛，市二等奖、省三等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b45a8b1c7.jpg-tinyq30', '11', '重庆交通职业学院学生会副主席'),
(42, '罗琳', 60, '罗琳，女，共青团员，重庆旅游职业学院2014级旅游管理系导游专业学生，现任重庆旅游职业学院学生会主席。曾荣获濯水古镇主题演讲比赛优秀奖、第二届大学生职场模拟招聘大赛三等奖、学生会每月之星。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b6392c524.png-tinyq30', '0', '重庆旅游职业学院学生会主席'),
(43, '谭遥尧', 60, '谭遥尧，男，共青团员，重庆旅游职业学院2014级旅游装备系汽车检测与维修专业学生，现任重庆旅游职业学院学生会副主席，兼音乐社社长。多次负责学校的活动，组织、策划，喜爱音乐并精通多门乐器，曾获学院歌手大赛三等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b664b6326.jpg-tinyq30', '0', '重庆旅游职业学院学生会副主席，兼音乐社社长'),
(44, '廖珊', 60, '廖珊，女，共青团员，重庆旅游职业学院2014级旅游管理系导游专业学生，现任重庆旅游职业学院学生会副主席。曾被评选为“军训优秀学员”、曾荣获学校导游大赛二等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608b687eec71.jpg-tinyq30', '0', '重庆旅游职业学院学生会副主席'),
(45, '钟明静', 61, '钟明静，女，共青团员，重庆公共运输职业学院城市交通运输专业2014级专科生，现任重庆公共运输职业学院学生会主席。曾被评为2014年“优秀共青团员”，2014年“大学生预防艾滋病”演讲比赛二等奖，“第二届中华经典诵读”比赛三等奖等等。身为主席团的一员，我一直秉承没有拖沓繁复的规划，并且所有的计划都会从实际着手。认真做好每一期的工作，办好每一次的活动，树立好每一回引领的旗帜，上传下达好每一份总结。积极和他系做好交际，取长补短，带领这一届学院学生会尽自己最大所能向着辉煌的道路前进。', 'http://redrock.u.qiniudn.com/2015-09-28_5608bcc3dc624.jpg-tinyq30', '2', '重庆公共运输职业学院学生会主席'),
(46, '邓帅', 61, '邓帅，男，共青团员，重庆公共运输职业学院轨道控制专业2014级专科生，现任重庆公共运输职业学院学生会副主席。曾被评为2014—2015学期“优秀学生”，在新生军训中被评为“优秀学员”，在诵读比赛中被评为 优秀组织者。在大一这一年中担任班长和院广播站播音员等职务。参加学院党校学习成为入党积极分子。不论在学习中还是工作上，我始终让自己保持着积极向上的态度，让自己都能时刻准备着迎接新的挑战。并且自己拥有着强大的组织能力和团队协调能力能够很好的调动团队积极性提高团队工作效率。我也相信成功永远属于一直在跑的人，我们', 'http://redrock.u.qiniudn.com/2015-09-28_5608bcf17b141.JPG-tinyq30', '0', '重庆公共运输职业学院学生会副主席'),
(47, '段佳丽', 61, '段佳丽，女，共青团员，重庆公共运输职业学院轨道电气控制专业2014级专科生，现任公共运输职业学院学生会副主席。曾被评为“优秀学生干部”军训优秀学员” ，大一这一年我在班上担任“学习委员”一职，在学生会里担任“学习部干事”。活泼开朗、乐观向上的我在工作上脚踏实地、认真负责，勇于迎接新挑战。我有较强的组织能力和活动策划能力，有较强的语言表达能力，还有较强的团队精神。不曾经历风雨怎能见彩虹，没有人能够随随便便成功。学习工作都需要付出，付出有苦，也有乐，没有终点，只有起点，没有最好，只更好。因为我始终奉持着一种信', 'http://redrock.u.qiniudn.com/2015-09-28_5608bd2987aef.jpg-tinyq30', '0', '重庆公共运输职业学院学生会副主席'),
(48, '胡军安', 63, '胡军安，女，共青团员，重庆轻工职业学院会展策划与管理专业2014级专科生，现任重庆轻工职业学院院学生会主席团成员。', 'http://redrock.u.qiniudn.com/2015-09-28_5608bd9656f83.jpg-tinyq30', '0', '重庆轻工职业学院院学生会主席团成员'),
(49, '谭抒琴', 63, '谭抒琴，女，共青团员，重庆轻工职业学院营养与食品卫生专业，2014级专科生，现任重庆轻工职业学院院学生会主席团成员。', 'http://redrock.u.qiniudn.com/2015-09-28_5608bddf5685b.jpg-tinyq30', '0', '重庆轻工职业学院院学生会主席团成员'),
(50, '陈曦', 64, '陈曦，女，共青团员，重庆幼儿师范高等专科学校学前教育2013级专科生，现任重庆幼儿师范高等专科学校校学生会主席，曾被评为2014——2015学年度共青团优秀团干部；“党的十八大四中全会精神”宣传PPT制作、讲解大赛中，荣获一等奖；“让青春构建和谐校园”演讲比赛一等奖；2014年全区“中华魂”（放飞梦想）青少年读书活动征文比赛（青年组）二等；“我的学前梦”演讲比赛中，荣获一等奖；5.25心理手抄报三等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608be2d2cd8e.jpg-tinyq30', '0', '重庆幼儿师范高等专科学校校学生会主席'),
(51, '田兰', 64, '田兰，女，共青团员，重庆幼儿师范高等专科学校2014级专科生，现任重庆幼儿师范高等专科学校学生会副主席。在学校第二届运动会中荣获“优秀裁判员”。首届校园之星“书法之星”选拔大赛中荣获“三等奖”“微课之星”荣获“三等奖”。曾获得“优秀团干部”光荣称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608be558ba03.jpg-tinyq30', '0', '重庆幼儿师范高等专科学校学生会副主席'),
(52, '唐道珍', 64, '唐道珍，女，共青团员，重庆幼儿师范高等专科学校2014级专科生，现任重庆幼儿师范高等专科学校学生会副主席。大学军训期间刻苦训练获得“优秀学员”的称号。在学校第二届运动会中荣获“优秀裁判员”。首届校园之星之“微课之星”选拔大赛中获得“优秀奖”。学校举办的第三届大学生成长论坛“青春微课堂”比赛获得“一等奖”，并代表学校参加万州区片区比赛获得三等奖。从事学生工作获得“优秀团干部”称号。参加系部“我的学前梦”演讲比赛荣获“第一名”。学校举行的“践行核心价值观，凝聚中华正能量”主题演讲比赛获得“三等奖”。在学校举办', 'http://redrock.u.qiniudn.com/2015-09-28_5608be829f956.jpg-tinyq30', '5', '重庆幼儿师范高等专科学校学生会副主席'),
(53, '张一帆', 2, '张一帆，男，共青团员，西南大学含弘学院袁隆平班专业，现任西南大学学生会主席。曾被评为西南大学三好学生，荣获国家励志奖学金等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608c6c28e438.jpg-tinyq30', '16', '西南大学学生会主席'),
(54, '孙瑞杰', 2, '孙瑞杰，男，预备党员，西南大学音乐表演专业2013级本科生，现任西南大学学生会副主席。曾获维也纳金色大厅青少年文艺晚会“金奖”、西南大学一等奖学金、西南大学科技创新先进个人、大学生暑期“三下乡”社会实践活动先进个人、优秀共青团员、优秀共青团干部、优秀学生会干事、优秀学生会部长、“国学季风”中华传统才艺竞赛优秀展演奖、西南大学第一届模拟面试大赛优秀奖等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608c73f57314.png-tinyq30', '8', '西南大学学生会副主席'),
(55, '陈鹏', 2, '陈鹏，男，中共党员，西南大学2013级人文地理与城乡规划本科生，现任西南大学大学学生会副主席。曾被评为四川省优秀共青团员、西南大学优秀共青团员、西南大学优秀共青团干部、西南大学优秀学生会干事、西南大学地理科学学院优秀共青团干部等。主持建设西南大学学生会网站、微信公众平台等，曾获教育部全国高校百佳网站等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608c7caf177b.jpg-tinyq30', '10', '西南大学大学学生会副主席'),
(57, '邹竞慧', 2, '邹竞慧，女，共青团员，西南大学法学2013级本科生，现任西南大学学生会副主席，曾被评为第十二届中国-新加坡优秀本科生交流项目中国代表、西南大学优秀共青团员、西南大学团校培训优秀学员、西南大学学生会优秀部长等，曾获校园之春“说写行”学生干部风采大赛市二等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608c926df571.JPG-tinyq30', '11', '西南大学学生会副主席'),
(58, '汪晋北', 2, '汪晋北，男，共青团员，西南大学广播电视编导专业2013级本科生，现任西南大学学生会副主席。曾获得第二届“麦芒杯”创新创业大赛一等奖。西南大学创业者，校园020水果微信公众号“零跃生活”创始人。凭此微信，曾发起过“要送就送一整栋”的投票活动，此活动参与人数过2万，转发过千。获得腾讯大渝网、重庆晨报、重庆华龙网的报道。湖北零跃科技有限公司创始人', 'http://redrock.u.qiniudn.com/2015-09-28_5608c98700e91.JPG-tinyq30', '10', '西南大学学生会副主席'),
(59, '高铭泽', 2, '高铭泽，男，中共党员，西南大学体育学院2013级本科生，现任西南大学学生会副主席，曾被评为西南大学优秀共青团员，西南大学体育先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608c9a95b114.jpg-tinyq30', '4', '西南大学学生会副主席'),
(60, '李晋泽', 3, '李晋泽，男，共青团员，西南政法大学会计学专业2012级本科生，现任西南政法大学学生会主席。曾被评为西南政法大学“优秀共青团干部”，西南政法大学学生会“优秀干部”、西南政法大学2012级本科学生军训优秀学员。任职期间带领学生会成员完成了“毓秀议苑”、“校园十大歌手大赛”和“感动校园—西政学子年度人物评选”等活动的筹备和执行工作。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ccffda71d.jpg-tinyq30', '0', '西南政法大学学生会主席'),
(61, '郑思思', 3, '郑思思，女，共青团员，西南政法大学经济法学院2012级本科，现任西南政法大学学生会副主席。曾被评为“西南政法大学三下乡先进个人”、“西南政法大学学生会优秀干事”、“西南政法大学学生会优秀干部”等，系共青团西南政法大学委员会第十二次代表大会代表。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cd5536c35.jpg-tinyq30', '0', '西南政法大学学生会副主席'),
(62, '吴鉴雨', 3, '吴鉴雨，男，中共党员，西南政法大学外语学院英语专业2012级学生，现任西南政法大学学生会副主席。曾被评为校三下乡先进个人、优秀学生干部、三好学生，多次获得学校综合奖学金。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cd817b92f.jpg-tinyq30', '0', '西南政法大学学生会副主席'),
(65, '付雪玲', 3, '付雪玲，女，汉族，西南政法大学应用法学院2012级本科生，现任西南政法大学学生会副主席。多次组织参与校级、市级大型艺术类活动，如大学生艺术展演、高雅艺术进校园、重庆市2014“校园之春”体育舞蹈大赛总决赛等。曾获校学生会“优秀干事”、“社会实践先进个人”等称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cde9b2122.jpg-tinyq30', '0', '西南政法大学学生会副主席'),
(66, '向恒', 5, '向恒，男，共青团员，文学院2013级汉语言文学（师范）本科生，现任重庆师范大学学生委员会主席。曾获得校级“精神文明先进个人”，“优秀学生干部”等荣誉。在平时工作中认真严谨，原则性强，有较强的守时意识，注重团队协作的作用，使各个部门既能够各司其职又能够互相沟通了解，在自己的岗位上发挥出最大的能量。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cec6c415d.png-tinyq30', '3', '重庆师范大学学生委员会主席'),
(67, '冯滟钦', 5, '冯滟钦，女，共青团员，教育科学学院2013级学前教育本科生，现任重庆师范大学学生委员会副主席。曾在校庆60周年活动中获得先进个人称号，也曾多次举办校级活动。我的性格偏于外向，为人坦率、热情、讲求原则，具有良好的管理、组织、沟通能力。最大的满足感在于接手的事情顺利完成，希望在以后的工作中对于没有秩序感的人多一点耐心。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cee636db4.png-tinyq30', '0', '重庆师范大学学生委员会副主席'),
(68, '陈晓', 5, '陈晓，男，共青团员。重庆师范大学数学科学学院统计学专业2013级本科生，现任重庆师范大学学生委员会副主席。曾被评为重庆师范大学“优秀学生干部”，策划组织过校级活动“校园十佳歌手”、“女生节晚会”。我很强的事业心和责任感使我能够面对任何困难和挑战。现在可以把服务同学作为一项跟自己息息相关的事业来做，会积极努力地为全校师生提供更好的服务。', 'http://redrock.u.qiniudn.com/2015-09-28_5608cf0489ae1.png-tinyq30', '0', '重庆师范大学学生委员会副主席'),
(70, '李思豪', 4, '李思豪，男，共青团员，重庆医科大学临床医学专业2012级本科生，现任重庆医科大学校团委学生副书记。曾被评为校级优秀共青团干部、校级社会实践先进个人、优秀共青团员、获得2015年重庆医科大学第十四届“挑战杯”一等奖，2014年国家卫计委“关爱女孩志愿者行动”调研报告评选活动国家级团体一等奖，2015年“校园之春”书评影评大赛校级、市级二等奖等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f3e4d42ab.png-tinyq30', '1', '重庆医科大学校团委学生副书记'),
(71, '边晓玮', 4, '边晓玮，女，预备党员，重庆医科大学临床医学专业2012级本科生，现任重庆医科大学校团委学生副书记。曾被评为“关爱女孩”志愿行动调研报告全国个人二等奖、“创青春”全国大学生创业大赛三等奖，重庆赛区金奖、重庆市“校园之春”一站到底职场模拟大赛二等奖、重庆市优秀共青团员、重庆医科大学“优秀学生干部”、“优秀共青团员”、“社会实践先进个人”、“青年志愿者先进个人” 。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f41b1bd2d.png-tinyq30', '0', '重庆医科大学校团委学生副书记'),
(72, '刘家秀', 4, '刘家秀，女，中共党员，重庆医科大学预防医学专业2012级本科生，现任重庆医科大学学生会主席。全国学联26大正式代表，中国大学生骨干培养学校第八期学员。曾被评为国家卫计委“关爱女孩”志愿行动调研报告全国一等奖、2014重庆市“三下乡”社会实践先进个人、第34届校园之春高校学生干部风采大赛市级一等奖、2015年挑战杯重庆市二等奖、2015重医学子年度人物、校优干。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f44f1fc57.png-tinyq30', '1', '重庆医科大学学生会主席'),
(73, '许波', 4, '许波，男，预备党员，重庆医科大学信息管理与信息系统（医药卫生方向）专业2012级本科生，现任重庆医科大学学生会常务副主席。曾被评为：国家卫计委关爱女孩调研活动“一等奖”，重庆市学生会工作先进个人，校级优秀共青团员，校级“优干”，校级“三好”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f472535a7.png-tinyq30', '0', '重庆医科大学学生会常务副主席'),
(74, '郁华燕', 4, '郁华燕，女，团员，重庆医科大学麻醉专业2013级本科生，现任重庆医科大学学生会副主席兼青年志愿者联盟主席。曾被评为重庆医科大学“优秀共青团员”、“优秀志愿者”、校级“优秀学生干部”、“优秀共青团干”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f49bbe1ec.png-tinyq30', '0', '重庆医科大学学生会副主席兼青年志愿者联盟主席'),
(75, '魏峰', 4, '魏峰，男，共青团员，重庆医科大学中医学2012级本科生，现任重庆医科大学学生会副主席兼学生社团联合会主席。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f4bd7fc87.png-tinyq30', '0', '重庆医科大学学生会副主席兼学生社团联合会主席'),
(76, '陈智慧', 4, '陈智慧，女，共青团员，重庆医科大学儿科七年制专业2012级本科生，现任重庆医科大学学生会副主席兼学生自律委员会主席。曾被评为社会实践先进个人，自立自强先进个人，优秀志愿者。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f4dfdb545.png-tinyq30', '0', '重庆医科大学学生会副主席兼学生自律委员会主席'),
(77, '刘灵芷', 4, '刘灵芷，女，共青团员，重庆医科大学检验生物技术专业2012级本科生，现任重庆医科大学学生会副主席兼大学生艺术团团长。曾被评为优秀共青团干部、社会实践先进个人等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f519b0feb.png-tinyq30', '0', '重庆医科大学学生会副主席兼大学生艺术团团长'),
(78, '朱芮', 4, '朱芮 女 共青团员 重庆医科大学卫生检验专业2012级本科生，现任重庆医科大学学生会副主席兼任学生宣传新闻中心主任，曾被评为系三好，优秀共青团员，优秀共青团干部，三下乡关爱女孩活动优秀志愿者，获国家励志奖学金。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f53fc79c4.png-tinyq30', '0', '重庆医科大学学生会副主席兼任学生宣传新闻中心主任'),
(79, '刘青', 4, '刘青，女，预备党员，重庆医科大学中医学专业2012级本科生，现任重庆医科大学学生会副主席。曾被评为重庆医科大学“精神文明建设先进个人”、“社会实践先进个人”。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f56a819bd.png-tinyq30', '0', '重庆医科大学学生会副主席'),
(81, '杨睿', 5, '杨睿，男，共青团员，重庆师范大学光电信息科学与工程2013级本科生，现任重庆师范大学学生委员会副主席。曾被评为重庆师范大学优秀共青团员、“三下乡”社会实践先进个人、优秀志愿者等。性格开朗、讲究原则、实事求是；具有良好的组织管理及沟通能力；最大的理想是用自己有限的力量做出更多的有意义的事情。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f5eba73fb.png-tinyq30', '0', '重庆师范大学学生委员会副主席'),
(82, '肖侨伟', 6, '肖侨伟，男，预备党员，重庆邮电大学机械设计制造及其自动化专业2013级本科生，现任重庆邮电大学学生会主席。曾参与重庆市市级创新创业项目研发，获重庆邮电大学优秀学生奖学金、第十二届“信科杯”辩论赛冠军及最佳辩手称号、“四个一”微演讲比赛第二名、生存挑战大赛团体三等奖及个人优秀奖、校级数模大赛三等奖；曾被评为优秀共青团员、优秀学生干部、三好学生。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f66b38fd6.jpg-tinyq30', '3', '重庆邮电大学学生会主席'),
(83, '陈浩', 6, '陈浩，男，预备党员，重庆邮电大学IT精英班专业2013级本科生，现任重庆邮电大学学生会副主席。曾获重庆邮电大学优秀学生三等奖学金、IT精英培养资助计划奖学金、“TI杯”重庆市大学生电子设计竞赛优秀奖、重庆邮电大学大学生数学建模三等奖等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f69482763.jpg-tinyq30', '2', '重庆邮电大学学生会副主席'),
(84, '章庆', 6, '章庆，男，共青团员，重庆邮电大学知识产权专业2013级本科生，现任重庆邮电大学学生会副主席。管理运营重庆邮电大学学生会微信公众号新媒体平台，平台粉丝数、图文阅读量、平台活跃度在重庆市高校新媒体平台中均位于前列，参与创新创业项目《Gesip—信息安全教育平台》获校级立项。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f6b22e467.jpg-tinyq30', '1', '重庆邮电大学学生会副主席'),
(85, '尹一凡', 6, '尹一凡，女，共青团员，重庆邮电大学软件工程专业2013级本科生，现任重庆邮电大学学生会副主席。曾设计制作大量视频、微电影等校园文化产品，负责活动宣传片等视频的拍摄及海报的设计，策划开展了校园文化创意活动，曾设计的重邮色彩明信片被重庆晨报报道，重邮快访系列街头采访受到广泛关注。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f70f5237a.jpg-tinyq30', '2', '重庆邮电大学学生会副主席'),
(86, '甘林', 6, '甘林，男，共青团员，重庆邮电大学动画专业2013级本科生，现任重庆邮电大学学生会副主席。主持操办学校“草坪音乐会”“十大歌手赛”“重邮梦想秀”等多个大型文体活动，活动质量个效果获得广泛好评，曾获标牌大赛第一名。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f73c6e57a.jpg-tinyq30', '1', '重庆邮电大学学生会副主席'),
(87, '梁佳妮', 6, '梁佳妮，女，共青团员，重庆邮电大学艺术设计专业2013级本科生，现任重庆邮电大学学生会副主席。曾获重庆邮电大学优秀学生二等奖学金；被评为“ 三好学生”、“优秀共青团干部”、第八届涂鸦大赛优秀奖等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f75de0723.jpg-tinyq30', '1', '重庆邮电大学学生会副主席'),
(88, '张瑞丰', 7, '张瑞丰，男，山东淄博人，就读于重庆交通大学机电与车辆工程学院2013级工程机械专业。现任校团委组织部干部、重庆交通大学学生会主席，曾任中华全国学生联合会第二十六次代表大会正式代表、重庆市学生联合会驻会干部、重庆市红岩菁英第八期大学生骨干培训班毕业学员、重庆交通大学学生会双福分会主席，大学期间获得多项省部级、校级奖励。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f7fae83a6.png-tinyq30', '1', '重庆交通大学学生会主席'),
(93, '徐艺珊', 8, '徐艺珊，女，共青团员，重庆工商大学金融专业2013级本科生，现任重庆工商大学学生会主席。曾获重庆工商大学优秀团员、&quot;36182&quot;大学生素质拓展工程标兵。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f8bdc87ed.jpg-tinyq30', '1', '重庆工商大学学生会主席'),
(94, '温云麟', 8, '温云麟，男，共青团员，重庆工商大学投资专业2013级本科生，现任重庆工商大学学生会副主席。曾获重庆工商大学优秀团干、文明大学生、英国保诚公司基金投资大赛第一名、重庆大学生艺术团民乐团二等奖、二胡通过十级考试、游泳二级运动员。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f91293e01.jpg-tinyq30', '0', '重庆工商大学学生会副主席'),
(96, '胡治丞', 8, '胡治丞，男，共青团员，重庆工商大学公共事业管理专业2013级本科生，现任重庆工商大学学生会副主席。曾被评为重庆工商大学“优秀团员”、重庆工商大学演讲与口才大赛二等奖、重庆工商大学党校培训“优秀学员”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f96ae7d83.jpg-tinyq30', '0', '重庆工商大学学生会副主席'),
(97, '梁艳秋', 8, '梁艳秋，女，共青团员，重庆工商大学信息管理与信息系统2013级本科生，现任重庆工商大学学生会副主席。曾被评为“三下乡”先进个人、优秀团干部、重庆工商大学新儒商商务谈判大赛二等奖等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f98871a9a.jpg-tinyq30', '1', '重庆工商大学学生会副主席'),
(98, '宁钰茹', 8, '宁钰茹，女，共青团员，重庆工商大学文学与新闻学院2013级本科生，现任重庆工商大学学生会副主席。曾获重庆工商大学优秀综合学生一等奖、社会实践先进个人、优秀学生、优秀团员、团校培训获“优秀学员”等称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f9a1816ec.jpg-tinyq30', '0', '重庆工商大学学生会副主席'),
(99, '秦春松', 8, '秦春松，男，共青团员，重庆工商大学市场营销专业2013级本科生，现任重庆工商大学学生会副主席。曾荣获国家奖学金、重庆市“三创”竞赛一等奖、校级一等奖学金、优秀学生干部、优秀团员、文明大学生、36182素拓工程标兵、“六大赛事”一等奖等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608f9bdab7a2.jpg-tinyq30', '0', '重庆工商大学学生会副主席'),
(100, '王炼', 9, '王炼，女，共青团员，重庆理工大学工商管理专业2013级本科生，现任重庆理工大学学生会主席。曾获“三创”比赛市级优胜奖、重庆理工大学“优秀军训学员”、重庆理工大学“共青团工作积极分子”、重庆理工大学综合奖学金等。', '', '0', '重庆理工大学学生会主席'),
(101, '罗喻夫', 9, '罗喻夫，男，共青团员，重庆理工大学会计信息化专业2013级本科生，现任重庆理工大学学生会副主席，校定向越野队队长。曾获重庆理工大学“优秀共青团员”、校综合甲等奖学金、“理工杯”大学生创业大赛校级三等奖等', 'http://redrock.u.qiniudn.com/2015-09-28_5608fa702cb95.jpg-tinyq30', '1', '重庆理工大学学生会副主席'),
(102, '陈彦霖', 9, '陈彦霖，女，共青团员，重庆理工大学财务管理专业2013级本科生，现任重庆理工大学学生会副主席。曾获校综合奖学金、校“优秀共青团员”、国家级“中国舞”5级证书、重庆市“优秀志愿者”、“健美操”大赛校级一等奖等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fa8f9e718.jpg-tinyq30', '0', '重庆理工大学学生会副主席'),
(103, '蒋吉', 9, '蒋吉，女，中共预备党员，重庆理工大学劳动与社会保障专业2013级本科生，现任重庆理工大学学生会副主席。曾获重庆市“校园之春”高校学生干部“说、写、行”风采大赛一等奖、校学子“百家讲坛”二等奖，校综合甲等奖学金等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608faaa14d78.jpg-tinyq30', '2', '重庆理工大学学生会副主席'),
(104, '王鸣康', 9, '王鸣康，男，中共预备党员，重庆理工大学物联网工程专业2013级本科生，现任重庆理工大学学生会副主席。曾获市级美术奖项两项、羽毛球奖项两项、重庆理工大学校级“优秀学生干部”等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fad040797.jpg-tinyq30', '0', '重庆理工大学学生会副主席'),
(105, '杨建民', 9, '杨建民，男，共青团员，重庆理工大学金融学专业2013级本科生，现任重庆理工大学学生会副主席，兼校青年志愿者协会会长。曾获重庆市科技馆“优秀志愿者”、重庆国际马拉松大赛“优秀志愿者”、校“优秀共青团干部”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fb063817a.jpg-tinyq30', '0', '重庆理工大学学生会副主席'),
(106, '马士伟', 9, '马士伟，男，共青团员，重庆理工大学材料成型及控制工程专业2013级本科生，现任重庆理工大学学生会副主席，兼任重庆理工大学社团联合会主席。曾获理工杯创业大赛三等奖、校园学子“百家讲坛”三等奖、“优秀社团干部”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fb2634909.jpg-tinyq30', '1', '重庆理工大学学生会副主席'),
(107, '陈映儒', 9, '陈映儒，男，共青团员，重庆理工大学应用物理学专业2013级本科生，现任重庆理工大学学生会副主席，兼校团委组织部部长。曾获重庆理工大学学子“百家讲坛”院级三等奖、重庆理工大学青年科技论坛院级二等奖、 “优秀共青团干部”等', 'http://redrock.u.qiniudn.com/2015-09-28_5608fb884a45d.jpg-tinyq30', '0', '重庆理工大学学生会副主席，兼校团委组织部部长'),
(108, '徐淋莉', 9, '徐淋莉，女，中共预备党员，重庆理工大学汉语国际教育专业2013级本科生，现任重庆理工大学学生会副主席，兼校团委传媒中心主任。曾获重庆理工大学校级甲等奖学金、校学子&quot;百家讲坛&quot;一等奖、校“优秀共青团干部”等。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fbafa884c.jpg-tinyq30', '0', '重庆理工大学学生会副主席');
INSERT INTO `president` (`id`, `president`, `school_id`, `introduce`, `pic`, `praise`, `posization`) VALUES
(109, '张雪莹', 10, '张雪莹，女，共青团员，四川外国语大学汉语国际教育专业2013级本科生，现任四川外国语大学学生会代理副主席。曾被评为四川外国语大学2013-2014学年度“三优一佳优秀团员”，重庆市第四届大学生艺术展演活动先进个人；曾任重庆市“校园之春”歌手大赛、流行舞大赛志愿者。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fc6df4015.jpg-tinyq30', '3', '四川外国语大学学生会代理副主席'),
(110, '谢雨薇', 10, '谢雨薇，女，共青团员，四川外国语大学德语专业2013级本科生，现任四川外国语大学学生会代理副主席。曾在四川外国语大学2013-2014学年度“三优一佳”评比活动中被评为优秀团员，多次担任重庆市大学生“校园之春”活动志愿者。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fcbe14e95.jpg-tinyq30', '0', '四川外国语大学学生会代理副主席'),
(111, '蔡珺瑶', 10, '蔡珺瑶，女，共青团员，四川外国语大学国际政治专业2013级本科生，现任四川外国语大学学生会代理副主席。曾被评为四川外国语大学2014-2015学年度“青年志愿者先进个人”，“三优一佳优秀团员”等；曾任重庆市“校园之春”歌手大赛志愿者，亚欧互联互通产业对话会志愿者。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fce0d5efb.jpg-tinyq30', '0', '四川外国语大学学生会代理副主席'),
(112, '陈洪', 10, '陈洪，男，四川外国语大学东方语学院阿拉伯语专业2013级本科生，现任四川外国语大学学生会代理副主席。积极参加学校各个活动以及社会实践活动，工作认真负责，努力向上，拼搏奋进。曾被评为四川外国语大学优秀学生干部。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fcffe5806.jpg-tinyq30', '1', '四川外国语大学学生会代理副主席'),
(113, '刘玉洁', 10, '刘玉洁，女，共青团员，四川外国语大学外交学专业2013级本科生，现任四川外国语大学校学生会代理副主席。曾被评为重庆市“第四届大学生艺术展演活动”先进个人，“自立自强优秀大学生”和“优秀学员”。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fd18b6355.jpg-tinyq30', '0', '四川外国语大学校学生会代理副主席'),
(114, '宋宛融', 10, '宋宛融，女，共青团员，四川外国语大学汉语言文学（中外文化交流方向）专业2013级本科生，现任四川外国语大学学生会代理副主席。曾被评为四川外国语大学2013-2014学年优秀层长。曾获得四川外国语大学校级三等奖学金.', 'http://redrock.u.qiniudn.com/2015-09-28_5608fd38af407.jpg-tinyq30', '1', '四川外国语大学学生会代理副主席'),
(115, '许若漫', 11, '许若漫，女，中共预备党员，四川美术学院中国画系书法专业2013级本科生，现任四川美术学院校学生会主席，曾被评为校“2014-2015优秀学生干部”、“2014-2015优秀共青团员”、并多次荣获先进个人、为学校争取赞助。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fd6b66a0b.png-tinyq30', '0', '四川美术学院校学生会主席'),
(116, '胡冰青', 11, '胡冰青 ，女，共青团员，四川美术学院新媒体艺术系2013届本科生，现任四川美术学院校学生会副主席，曾评获“2014-2015年优秀学生干部”，以及“2014-2015晚会先进个人”', 'http://redrock.u.qiniudn.com/2015-09-28_5608fd85a6884.png-tinyq30', '2', '四川美术学院校学生会副主席'),
(117, '伍姝梅', 11, '伍姝梅，女，中共党员，四川美术学院工艺美术专业2013届本科生，现任四川美术学院学生会副主席。曾评获2014-2015年“争先创优”称号；评为2014-2015优秀学生干部和先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fdaea3038.png-tinyq30', '0', '四川美术学院学生会副主席'),
(118, '曾婉妮', 11, '曾婉妮，女，共青团员，四川美术学院美术学系艺术策划与管理专业2013届本科生，现任四川美术学院学生会副主席。曾被评为2014-2015优秀学生干部和先进个人，2014-2015精神文明先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fdc61e766.png-tinyq30', '0', '四川美术学院学生会副主席'),
(119, '韩小雨', 11, '韩小雨，男，共青团员，四川美术学院美术教育系平面设计专业2013届本科生，现任四川美术学院学生会副主席。曾评获曾被评为重庆市“三下乡”社会实践先进个人，评为2014-2015优秀学生干部和先进个人。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fde13b62b.png-tinyq30', '0', '四川美术学院学生会副主席'),
(120, '吴鹏', 12, '吴鹏，男，中共预备党员，重庆三峡学院土木工程专业2012级本科生，现任重庆三峡学院团委学生副书记。曾被评为重庆市“三下乡”社会实践先进个人，重庆市“青年志愿者先进个人”，重庆三峡学院“三好学生”、“优秀共青团干部”等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fe14cd560.jpg-tinyq30', '0', '重庆三峡学院团委学生副书记'),
(121, '胡雅雯', 12, '胡雅雯，女，中共预备党员，重庆三峡学院广告学专业2013级本科生，现任重庆三峡学院学生会主席。曾获得重庆市“第34届校园之春职场挑战赛”特等奖，重庆三峡学院“三好学生”、“优秀共青团员”，连续多次获得国家级、校级奖学金。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fe3387199.jpg-tinyq30', '2', '重庆三峡学院学生会主席'),
(123, '董梦影', 12, '董梦影，女，共青团员，重庆三峡学院法学专业2013级本科生，现任重庆三峡学院团委学生会副主席。曾被评为重庆三峡学院“优秀共青团员”“优秀共青团干部”“优秀学生干部”“自立自强先进个人”，多次获得校级奖学金。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fe6c54012.jpg-tinyq30', '0', '重庆三峡学院团委学生会副主席'),
(124, '周干评', 12, '周干评，男，中共预备党员，重庆三峡学院土木工程专业2013级本科生，现任重庆三峡学院学生会副主席。曾被评为重庆三峡学院“三好学生”、“优秀共青团员干部”、“优秀共青团员”、“自立自强先进个人”等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-28_5608feba3e0e8.jpg-tinyq30', '0', '重庆三峡学院学生会副主席'),
(125, '李鹏程', 12, '李鹏程，男，中共预备党员，重庆三峡学院机械电子工程专业2013级本科生，现任重庆三峡学院团委学生会副主席。曾被评为重庆三峡学院“优秀共青团员”，重庆三峡学院“优秀共青团干部”，多次国家级、校级奖学金。', 'http://redrock.u.qiniudn.com/2015-09-28_5608feecc25fa.jpg-tinyq30', '0', '重庆三峡学院团委学生会副主席'),
(126, '涂客松', 12, '涂客松，男，共青团员，重庆三峡学院机械电子工程专业2013级本科生，现任重庆三峡学院学生会副主席兼学生团体联合会主席，曾获得重庆三峡学院&quot;优秀共青团员&quot;&quot;优秀共青团干&quot;“三好学生”等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ff0a228fa.jpg-tinyq30', '0', '重庆三峡学院学生会副主席兼学生团体联合会主席'),
(127, '杨蓓莉', 13, '杨蓓莉，女，共青团员，重庆文理学院应用心理学专业2013级本科生，现任重庆文理学院学生会主席。曾被评为“军训优秀学员”，“校级优秀共青团干部”，“校级优秀班干部”，第四届重庆市大学生艺术展演活动“校级先进工作者”；先后参加重庆市第五届大学生成长论坛之沙盘竞赛获二等奖，参加第十四届“挑战杯”全国大学生课外学术科技作品竞赛获重庆赛区一等奖；获得重庆文理学院特等奖学金、一等奖学金、二等奖学金各一次；曾在重庆文理学院第十四届“科技文化月”之“挑战杯”竞赛中获特等奖，在校定向越野比赛中获一等奖，在2014年暑期社会', 'http://redrock.u.qiniudn.com/2015-09-28_5608ffa8c0f7a.jpg-tinyq30', '8', '重庆文理学院学生会主席'),
(129, '黄加伟', 13, '黄加伟，男，入党积极分子，重庆文理学院体育教育专业2013级本科生，现任重庆文理学院学生会副主席，曾被评为“军训优秀学员”，在2013年第一学期中获得＂二等奖学金＂，2014年第一学期中获得＂二等奖学金＂，在2014年重庆市大学生舞蹈展演中荣获一等奖。', 'http://redrock.u.qiniudn.com/2015-09-28_5608ffd4a2613.jpg-tinyq30', '5', '重庆文理学院学生会副主席'),
(130, '刘扶太', 13, '刘扶太，男，共青团员，重庆文理学院材料成型及控制工程专业2013级本科生，现任重庆文理学院学生会副主席。曾在学校“五四评优”中被评为“优秀共青团员”；进入大学以来获得重庆文理学院一等奖学金三次；带领的团队在校知识安全竞赛中获得第一名；与同学一起组队并成功申请了科研立项，丰富了课余生活，将课堂上的理论运用到实践中。', 'http://redrock.u.qiniudn.com/2015-09-28_5608fffb06797.jpg-tinyq30', '2', '重庆文理学院学生会副主席'),
(131, '张凡', 13, '张凡，男，共青团员，重庆文理学院园林专业2013级本科生，现任重庆文理学院学生会副主席，曾获得学校特等奖学金和一等奖学金，举办且参与过多次活动，对学校学生组织工作认真负责，待人友好，喜欢与别人交朋友，有能力做好自己的本职工作，也能合理的带领部长完成学校学生组织的工作。', 'http://redrock.u.qiniudn.com/2015-09-28_56090013ca896.jpg-tinyq30', '3', '重庆文理学院学生会副主席'),
(184, '彭俊', 29, '彭俊，男，中共预备党员，重庆工贸职业技术学院机械设计与制造专业2013级专科生，现任重庆工贸职业技术学院学生会主席。曾代表参加“重庆市红岩菁英学校第八期大学生骨干培训”，与全市各高校优秀学生干部一同接受知识的洗礼和能力的考验，使其具有更加坚定的政治立场和较高的政治素质、思想觉悟。思想上积极进步，认真学习马列主义、毛泽东思想和邓小平理论、“三个代表” 重要思想和科学发展观，努力提高自身思想政治觉悟、道德情操和个人素养；并通过积极宣传、组织学生活动等 作为学院学生会主席，他切实遵循和贯彻党的教育方针，践行社会', '', '5', '校学生会主席'),
(186, '谌阳', 29, '谌阳，男，预备党员，重庆工贸职业技术学院建筑工程技术专业2013级专科生，现任重庆工贸职业技术学院学生会副主席。2013-2014学年学生会工作中表现优秀被评为“优秀学生干部”。本人性格活泼，责任心强，有较强的语言表达能力，平时做到宽厚待人，踏实工作，勤奋学习，经常与同学交流沟通，相互了解，并带领同学们共同进步，共同学习；有较强的组织能力、活动策划能力和公关能力，在大学期间曾多次领导组织大型体育赛事、文艺演出，并取得良好效果；有较强的团队精神，能够自觉地维护团队的集体荣誉，自觉地以团队的整体声誉为重来约束', '', '2', '校学生会副主席'),
(187, '吴霞', 29, '吴霞，女，中共预备党员，重庆工贸职业技术学院财经贸易系2013级会计电算化4班学生。现任重庆工贸职业技术学院学生会专职副主席、财经贸易系团总支副书记，2013级会计化4班班长。在大学里我不断的锻炼自己全面提高自己的综合素质，曾任院学生会系团总支秘书部干事主要负责照相、收集资料、整理文档，锻炼了我的细心、耐心，熟练的掌握了办公软件；在任院学生会专职副主席、系团总支副书记、班长期间很好的锻炼了我的组织、协调、领导能力；在青年志愿者服务队时组织大家一起去慰问老人、图书馆义工、市民学校服务等活动，提高了我的自信心', 'http://redrock.u.qiniudn.com/2015-09-30_560ab7bd833e6.jpg-tinyq30', '3', '校学生会副主席'),
(188, '刘妍欣', 29, '刘妍欣，女，共青团员，重庆工贸职业技术学院服装设计专业2013专科生，现任重庆工贸职业技术学院学生会副主席，艺术与文化传播系学生会主席。曾被评为：重庆工贸职业技术学院2013-2014第一学年“文艺活动先进个人”；2013-2014学生会“优秀学生干部”；2014年双五文艺演出“最佳组织奖”；2014年春期“优秀学生干部”。获得：2014年寝室文化艺术节寝室装扮“第三名”；2014年寝室文化艺术节篮球比赛“第二名”； 2014年国庆文艺晚会“二等奖”。', 'http://redrock.u.qiniudn.com/2015-09-30_560ab7f200c37.jpg-tinyq30', '2', '校学生会副主席'),
(189, '李红', 29, '李红，女，中共预备党员，重庆工贸职业技术学院学生会副主席、生物化学工程系学生会主席。思想积极上进，生活勤俭节约，工作认真刻苦，能够严格要求自己，尽职尽责，积极协助老师完成学生会各项工作，不仅是老师的好助手，也是同学的好帮手，在同学间威信高。积极指导各部门工作、合理分工，取得显著成绩。积极参加各项活动，德智体美全方面发展、具有吃苦耐劳的精神。合理利用时间，学习工作两不误。2013年秋期获得“学院一等奖学金”“才艺大比拼二等奖”“迎新杯篮球赛优秀运动员”2014年秋期获得“学院二等奖学金”、“三好学生”、“学', 'http://redrock.u.qiniudn.com/2015-09-30_560ab82b35ec7.jpg-tinyq30', '3', '校学生会副主席'),
(190, '赵雪娇', 29, '赵雪娇，男，中共预备党员，重庆工贸职业技术学院金融管理与实务专业2013级专科生，现任重庆工贸职业技术学院学生会副主席、财经贸易系学生会主席。曾被评为2013年度院级“优秀共青团员”、2013年秋期系“优秀学生干部”、2014年度获得社会实践“三下乡先进个人” “优秀学生干部”、2014年春期获得院“精神文明先进个人”、2013-2014年荣获“国家励志奖学金”2015年春期获得“文娱活动先进个人”两届低年级金融专业的“代理班主任”。是一个性格外向、处事沉稳，有着较好的管理及团队协作能力，一直践行品行端正', 'http://redrock.u.qiniudn.com/2015-09-30_560ab8849c3c1.jpg-tinyq30', '4', '校学生会副主席'),
(191, '任国文', 29, '任国文，男，共青团员，重庆工贸职业技术学院道路桥梁工程技术专业2014级专科生，现任重庆工贸职业技术学院学生会副主席。曾代表参加“重庆市红岩菁英学校第九期大学生骨干培训”，与全市各高校优秀学生干部一同接受知识的洗礼和能力的考验，使其具有更加坚定的政治立场和较高的政治素质、思想觉悟。思想上积极进步，认真学习马列主义、毛泽东思想和邓小平理论、“三个代表” 重要思想和科学发展观，努力提高自身思想政治觉悟、道德情操和个人素养；并通过积极宣传、组织学生活动等。', 'http://redrock.u.qiniudn.com/2015-09-30_560ab979d22db.JPG-tinyq30', '5', '校学生会副主席'),
(192, '张恒', 29, '张恒，男，共青团员，重庆工贸职业技术学院道路与桥梁专业2014级专科生，现任重庆工贸职业技术学院学生会副主席。本人性格开朗，责任心强，踏实真诚，积极进取。拥有较强的策划能力，组织能力，应变能力。大局意识较好，具有吃苦耐劳的精神，甘于奉献的品德。同时努力维护学生会的荣誉，能为学生会贡献出自己的力量，多次参与学院大型活动的组织丶协调工作，能高质量丶高标准完成上级领导交给的任务，也得到了上级领导的一致肯定。同时不断的给自己充电，参加红歌比赛，建筑工程系的青马工程培训等，使自己更加积极的向党靠拢！', 'http://redrock.u.qiniudn.com/2015-09-30_560ab9f369e77.jpg-tinyq30', '2', '校学生会副主席'),
(193, '曾盼', 29, '曾盼，男，共青团员，重庆工贸职业技术学院机电工程系2014级专科生。现任重庆工贸职业技术学院学生会副主席，曾在2014-2015学年被评为重庆工贸职业技术学院学生会“优秀学生干部”，在12.9红歌比赛中荣获“优秀奖”。      本人性格开朗，责任心强，踏实真诚，积极进取。拥有较强的策划能力，组织能力，应变能力。大局意识较好，具有吃苦耐劳的精神，甘于奉献的品德。同时努力维护学生会的荣誉，能为学生会贡献出自己的力量，多次参与学院大型活动的组织丶协调工作，能高质量丶高标准完成上级领导交给的任务，也得到了上级领', 'http://redrock.u.qiniudn.com/2015-09-30_560aba2f31809.jpg-tinyq30', '4', '校学生会副主席'),
(199, '夏靖淞', 24, '夏靖淞，男，共青团员，重庆电子工程职业学院会展设计专业2013级学生，现任重庆电子工程职业学院校团委学生会主席。曾多次获得学校“优秀共青团干部”称号、“三好学生”、“国家励志奖学金”，还曾代表重庆团队前往北京人民大礼堂参加中华全国学联第二十六次代表大会。在会议期间，以全国学联主席团单位的身份受到了国家副主席李源潮同志的亲切接见。     在平时学生会工作中，善于调配人才，狠抓学生会干部干事的思想工作和团结性。使整个集体做到有组织，有纪律，从而达到共同进步和发展。在学习上，时刻要求自己工作学习两不误，常虚心', 'http://redrock.u.qiniudn.com/2015-09-30_560abe31d3a8e.JPG-tinyq30', '0', '校学生会主席'),
(200, '李建', 24, '李建，女，共青团员，重庆电子工程学院嵌入式技术与应用2013级专科生，现任重庆电子工程职业学院校团委副书记。树立正确的人生观，价值观，形成了热情，上进，不屈不挠的性格和诚实。守信，有责任心，有爱心的人生信条，扎实的人生信条，诚实做人。忠实做事是我的人生准则，&quot;天道酬勤&quot;是我的信念，&quot;自强不息&quot;是我的追求。我不求流光溢彩，但求在合适的位置上发挥的淋漓尽致，我不期望有丰富的物质待遇，只希望用我的智慧，热忱和努力来实现我的社会价值和人生价值。', 'http://redrock.u.qiniudn.com/2015-09-30_560abe816b568.jpg-tinyq30', '0', '校团委副书记'),
(202, '江维', 24, '江维，男，共青团员，重庆电子工程职业学院建筑与材料学院工程造价专业2013级学生，现任重庆电子工程职业学院校学生会副主席。在学校的两年里，自己无论是从生活还是学习上都有着极大的收获，而在学生会的两年了却更是我在大学里面成长的根本，与学生会的同学们一起认真的工作和努力是我不可多得的精神财富和食粮。现在自己很乐意在这个合适的平台和空间来把这些精神财富散播出去，分享于他人，享受那种当自己的想法个观点都为大家认可和看见的感觉，想看见别人因为赞同和欣赏而流露出的那份欣慰和喜悦，实现别人因我的存在而感到幸福！我愿意把', 'http://redrock.u.qiniudn.com/2015-09-30_560abf0449d5d.jpg-tinyq30', '0', '校学生会副主席'),
(205, '黄国璨', 24, '黄国璨，男，共青团员，重庆电子工程职业学院物联网学院传感网专业2013级，专科生。现任重庆电子工程职业学院校学生会副主席。 一年学生干部期间，全面负责学生会工作，及时、准确地传达上级指示及精神，定期向团总支及相关部门请示、汇报工作，接受全院学生的监督；全面掌握并协调学生会各部门的工作，组织带领学生会各成员认真履行职责，集思广益，积极引导学生会内部的改革与创新工作；组织制定学院学生会章程，并依照学生会章程推荐学生会干部候选人，制定起草学生会学期、年度工作计划；研究布置工作，听取各部门的工作汇报，监督执行工作', 'http://redrock.u.qiniudn.com/2015-09-30_560abf9fb2666.jpg-tinyq30', '0', '校学生会副主席'),
(214, '高代清', 26, '高代清，女，入党积极分子。来自重庆城市管理职业学院工程管理学院物业管理A1401班。现任校团委学生会主席团成员，曾获2014级新生“优秀学员” 校团委学生会“优秀干事” 在工程管理学院“中国梦、工程情”晚会中获“优秀工作者”工程管理学院心理班会“最佳主持人”工程管理学院心理班会“最佳人气奖”工程管理学院朗诵比赛“优秀奖” 工程管理学院物业专业技能大赛“优秀奖” 工程管理学院“中国梦、工程情”晚会节目“三等奖” 工程管理学院学生会气排球比赛“第二名”在大一上期上交了入党申请书，拿到了放了结业证书，在大二下期', 'http://redrock.u.qiniudn.com/2015-09-30_560ac52c7c3e0.jpg-tinyq30', '0', '校主席团成员'),
(215, '伍勇', 26, '伍勇，男，共青团员，重庆城市管理职业学院文化产业管理学院环境艺术设计A1401，现任校团委学生会主席团成员，社团联合会主席，社联优秀干事。', 'http://redrock.u.qiniudn.com/2015-09-30_560ac567290f4.jpg-tinyq30', '0', '校主席团成员'),
(216, '郭泳良', 26, '郭泳良，共青团员，重庆城市管理职业学院工商管理学院物流管理2014级专科生，现任校学生会主席团。曾获校学生会“优秀干事” 、校园文化建设“文明寝室”、物流管理主题辩论赛“最佳主持人”', 'http://redrock.u.qiniudn.com/2015-09-30_560ac5a26de13.jpg-tinyq30', '1', '校主席团成员'),
(217, '呙欣怡', 26, '呙欣怡，女，共青团员，重庆城市管理职业学院航空服务2014级专科生，现任重庆城市管理职业学院学生会主席团。曾被评为第四十三期“党的基础知识”优秀学员、第五届“飓风杯”优秀干事、2015年春季田径运动会团体赛第一名、第九届校园文化艺术节 “寝室美化”二等奖及优秀奖等。', 'http://redrock.u.qiniudn.com/2015-09-30_560ac5cd27432.jpg-tinyq30', '1', '校主席团成员'),
(218, '刘一明', 26, '刘一明，男，重庆城市管理职业工商管理学院报关与国际货运A1401班。现任校团委主席团成员。2015年荣获工商管理学院“营销王”大赛三等奖 曾组织参与工商管理学院各项活动如：工商管理学院趣味运动会 重庆市沙坪坝区校园之春歌唱大赛海选现场志愿人员及一系列志愿活动。', 'http://redrock.u.qiniudn.com/2015-09-30_560ac5f1020e0.jpg-tinyq30', '0', '校主席团成员'),
(219, '陶何灵', 26, '陶何灵，女，共青团员，重庆城市管理职业学院航空服务专业2014级专科生。现任重庆城市管理职业学院校团委学生会主席团成员，在校三十周年校庆活动担任舞蹈演员、担任校运会现场工作人员、参加2015校春季田径运动会国旗方队、参加重庆市中职升高职技能大赛志愿者服务并接受聘书、担任重庆市高职院校中餐主题宴会摆台技能大赛志愿者、参加校级宣传片拍摄并授为优秀学生演员，我班在旅游文化节中荣获礼仪模范班级第一名，本人编排并代表班级参加旅游文化节闭幕式活动。', 'http://redrock.u.qiniudn.com/2015-09-30_560ac62824af3.jpg-tinyq30', '0', '校主席团成员'),
(220, '伍心洁', 27, '伍心杰 ，女 ，共青团员，重庆工程职业技术学院学生会主席，就读于营销与策划专业。一个热情似火的女汉子，为人老实厚道，做事认真负责。一直以的乐观心态去面对生活、面对学习、面对工作。曾获 “三好学生”等荣誉。', '', '1', '校学生会主席'),
(221, '张麟', 27, '张麟，男，预备党员，重庆工程职业技术学院学生会副主席，在老师悉心指导和同事支持参与下，本着“全心全意为同学服务”的工作宗旨，不断完善运行机制，健全工作职能。曾获“三好学生”等荣誉。', '', '0', '校学生会副主席'),
(222, '周长树', 27, '周长树，男共青团员，重庆工程职业技术学院学生会副主席，就读于地下工程与隧道工程技术专业。组织能力强，善于资源分析,有较强的独立性，工作中能够独当一面。曾获“优秀学生干部”等荣誉', '', '0', '校学生会副主席'),
(223, '周益', 27, '周益，男，预备党员，就读于机电一体化专业，重庆工程职业技术学院学生会副主席。曾被评为 “校级优秀学生会干部”。 在校期间，刻苦认真、吃苦耐劳;注重理论联系实际，培养自学能力以及分析、解决问题的能力。', '', '0', '校学生会副主席'),
(224, '周洪莹', 27, '周洪莹，女，共青团员，就读建筑装饰工程技术专业，重庆工程职业技术学院学生会副主席、公寓管理委员会主席。曾被评为“校级优秀学生干部”。本人做事谨慎细心，具有较高的责任感、为人和睦。 王艺谋，男，共青团员。重庆工程职业技术学院学生会副主席、社团联合会主席。就读于矿井通风与安全专业。在完成上级交予的任务外，能有力地组织同学及调动积极性; 从中也锻炼和提高了组织和领导能力。曾获“优秀学干部”等荣誉。', '', '0', '校学生会副主席'),
(248, '雷茜', 24, '雷茜，女，中共团员，就读于重庆电子工程职业学院通信专业，现任重庆电子工程职业学院校学生会副主席。 任职情况： 2013年9月—2014年9月  重庆电子工程职业学院学生会办公室干事 2014年9月—至今    重庆电子工程职业学院校团委学生会副主席、通信专业1304班班长 获奖情况： 2013年—2014年度优秀学生干部 2013年—2014年度优秀学生标兵 2013年—2014年度迎新工作优秀志愿者 2013年—2014年度获国家励志奖学金 2014年—2015年度优秀共青团员', 'http://redrock.u.qiniudn.com/2015-09-30_560ba209ab041.jpg-tinyq30', '0', '重庆电子工程职业学院校学生会副主席'),
(249, '王朝标', 29, '王朝标，共青团员，重庆工贸职业技术学院，汽车与电子工程系2013级应用电子技术专业，现任重庆工贸职业技术学院院学生会副主席，汽车与电子工程系学生分会副主席。曾被评为重庆市“三下乡”社会实践先进个人，体育先进个人，文明个人，优秀学生干部。曾参加重庆市市级征文比赛，感恩类：作品“心语”获得重庆市三等奖，重庆市市级职业生涯规划类：作品“我追逐我的梦”获得重庆市三等奖。并在学校多次举办演讲、朗诵，体育、书法计算机编程，电子装配大赛等：获得一等奖二等奖三等奖等荣誉。曾参与学生会秘书部、学习部、纪检部、生活部、外交部', '', '2', '重庆工贸职业技术学院院学生会副主席'),
(274, '礼享', 14, '礼享，男，中共预备党员，长江师范学院思想政治教育（师范）专业2013级本科生，现任校团委（学生）副书记、校学生会主席（兼），重庆市学联大学生新媒体中心“学载青春梦”微信编辑部副主编。历任班级班长，校团委办公室干事、主任，大学生科技爱好者协会会长助理。是“青年马克思主义者培养工程”重庆市红岩菁英学校第八期、第九期大学生骨干。参与的“挑战杯”大学生课外学术科技作品竞赛项目获重庆赛区一等奖。曾获校级三等奖学金，获评校级“‘三下乡’先进个人”、“优秀共青团员”、“优秀共青团干部”等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-30_560bbcfa0b293.jpg-tinyq30', '1', '校团委（学生）副书记、校学生会主席（兼），重庆市学联大学生新媒体中心“学载青春梦”微信编辑部副主编'),
(275, '唐大鹏', 14, '唐大鹏，男，共青团员，长江师范学院小学教育（全科）专业2013级本科生，现任校学生会常务副主席。历任班级班长，校学生会办公室干事、副主任。曾获“新生军训先进个人”、“优秀共青团员”、“精神文明建设先进个人”等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-30_560bbd5a93d90.jpg-tinyq30', '1', '校学生会常务副主席'),
(276, '陈美静', 14, '陈美静，女，共青团员，长江师范学院公共事业管理专业2013级本科生，现任校团委（学生）副书记、校学生会副主席。历任校团委组织部干事、部长，新生代理班主任，学生会宿管部干事，创艺摄影协会技术部干事。曾获“新生军训先进个人”，“优秀共青团干部”、“精神文明建设先进个人”等荣誉称号。', '', '0', '校团委（学生）副书记、校学生会副主席'),
(279, '李晶菡', 14, '李晶菡，女，共青团员，长江师范学院汉语言文学（师范）专业2013级本科生，现任校学生会副主席。曾获评校级“优秀共青团员”、“优秀学生会干部”、“优秀学生干部”等荣誉称号。', '', '0', '校学生会副主席'),
(280, '刘涛', 14, '刘涛，男，共青团员，长江师范学院生物工程专业2013级本科生，现任校学生会副主席。曾被评为我校志愿者组织“优秀志愿者”、“优秀支教老师”，校学生会“优秀干部”。', '', '0', '校学生会副主席'),
(281, '陈正', 14, '陈正，女，中共预备党员，长江师范学院旅游管理专业2013级本科生，现任校学生会副主席。曾获校级一、二等奖学金，获评“优秀学生干部”、“优秀志愿者”、“优秀共青团员”、“精神文明先进个人”等荣誉称号。', '', '0', '校学生会副主席'),
(282, '郑超文', 14, '郑超文，男，共青团员，长江师范学院体育健康专业2013级本科生，现任校学生会副主席。曾获评“优秀学生干部”、“优秀共青团员”、“精神文明先进个人”等荣誉称号。', '', '0', '校学生会副主席'),
(283, '黄潇', 16, '黄潇，女，共青团员，重庆第二师范学院旅游管理专业2013级本科生，现任重庆第二师范学院学生会主席。曾被评为“优秀干部”“优秀志愿者”“最佳辩手”。曾获得重庆共青团—学载青春梦稿件录用证书。', 'http://redrock.u.qiniudn.com/2015-09-30_560bbfa7c9d2c.jpg-tinyq30', '3', '重庆第二师范学院学生会主席'),
(284, '熊黄嘉宸', 16, '熊黄嘉宸，女，预备党员，重庆第二师范学院学前教育学院2013级本科生，现任重庆第二师范学院校学生会副主席，曾获校二等综合奖学金，校辩论赛亚军，“最佳辩手”“校级优秀学生干部”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc109eb20c.jpg-tinyq30', '1', '重庆第二师范学院校学生会副主席'),
(285, '邵璐瑶', 16, '邵璐瑶，女，重庆第二师范学院2013级汉语言文学专业本科，现任重庆第二师范学院校学生会副主席。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc155783ce.jpg-tinyq30', '1', '重庆第二师范学院校学生会副主席'),
(286, '刘钢', 16, '刘钢，男，共青团员，重庆第二师范学院小学全科教师数学与应用数学专业2013级本科生，现任重庆第二师范学院学生会副主席。曾被评为重庆第二师范学院暑期“社会实践优秀个人”，重庆第二师范学院入党积极分子“优秀学员”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc1804ceab.jpg-tinyq30', '1', '重庆第二师范学院学生会副主席'),
(287, '周甜', 16, '周甜，男，共青团员，重庆第二师范学院生物与化学工程系食品营养与检测专业2013级专科生，现任重庆第二师范学院学生会副主席，曾被评为“优秀干事”“优秀干部”“创业孵化班优秀团队”等 。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc1a919861.jpg-tinyq30', '1', '重庆第二师范学院学生会副主席'),
(288, '张忠伟', 16, '张忠伟，男，预备党员，重庆第二师范学院视觉传达设计专业2013级本科生，现任重庆第二师范学院学生会副主席。 曾多次获得一等奖学金，国家励志奖学金，获得“优秀团员”“三好学生”等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc1e4154ba.jpg-tinyq30', '1', '重庆第二师范学院学生会副主席'),
(289, '何馨如', 16, '何馨如，女，入党积极分子，重庆第二师范学院电子商务物流管理专业2013级本科生，现任重庆第二师范学院学生会副主席。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc21c9ca05.jpg-tinyq30', '1', '重庆第二师范学院学生会副主席'),
(290, '何盛', 17, '何盛，男，中共预备党员，重庆警察学院刑事犯罪侦查专业2012级本科生，现任重庆警察学院学生会主席。曾被评为重庆市青年志愿者先进个人、重庆市公安局优秀共青团员，曾荣获第五届“中国警界明日之星论坛”征文比赛全国一等奖、国家励志奖学金、中国扶贫基金协会“善行100.圆梦六一”爱心团队称号，荣获三好学生、优秀共青团干部等校表彰奖励13次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc2a7465aa.jpg-tinyq30', '6', '重庆警察学院学生会主席'),
(291, '王雨馨', 17, '王雨馨，女，中共预备党员，重庆警察学院交通管理工程专业2012级本科生，现任重庆警察学院学生会副主席。曾荣获重庆市公安局公会杯乐器大赛优秀奖、重庆市公安局元旦晚会《麻辣警花》二等奖，荣获三好学生、优秀大学生干部等校表彰奖励8次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc2e6487dc.jpg-tinyq30', '5', '重庆警察学院学生会副主席'),
(292, '王军翔', 17, '王军翔，男，共青团员，重庆警察学院刑事科学技术专业2012级本科生，现任重庆警察学院学生会副主席。曾被评为重庆市公安局优秀共青团干部，荣获优秀共青团干部、学院五四表彰暨歌咏比赛组织工作 “突出贡献奖等校表彰奖励6次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc30cc1c5b.jpg-tinyq30', '4', '重庆警察学院学生会副主席'),
(293, '沈俊良', 17, '沈俊良，男，共青团员，重庆警察学院刑事犯罪侦查专业2012级本科生，现任重庆警察学院学生会副主席。曾荣获渝北区优秀义工称号，荣获优秀大学生干部、优秀小教员、优秀共青团员等校级表彰奖励6次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc333c05a7.jpg-tinyq30', '46', '重庆警察学院学生会副主席'),
(294, '龚茂', 17, '龚茂，男，共青团员，重庆警察学院刑事犯罪侦查专业2013级本科生，现任重庆警察学院学生会副主席。曾荣获、第33届重庆市“校园之春”大学生模拟招聘大赛优秀奖，荣获三好学生、学院景铮杯演讲比赛二等奖、第三届校园文化艺术节征文比赛二等奖等校级表彰奖励6次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc363c494e.jpg-tinyq30', '3', '重庆警察学院学生会副主席'),
(295, '赖秋', 22, '赖秋，女，共青团员，重庆医药高等专科学校助产专业2014级在校学生，现任重庆医药高等专科学校学生会主席。同时也担任所在班级班长。曾在军训中被评为“优秀学员”；在我校第六届“炫彩金秋”校园文化艺术节之舞蹈大赛中表现优异荣获“最佳表演奖”；2014年-2015年学年因表现突出被评为“优秀共青团员”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc4864767e.JPG-tinyq30', '5', '重庆医药高等专科学校学生会主席'),
(296, '江蕊财', 22, '江蕊财，男,共青团员，重庆医药高等专科学校临床学专业2014级学生，现任重庆医药高等专科学校学生会副主席。来自山城重庆，是一位踏实刻苦的男生，生性幽默乐观。所谓年轻就是资本，拥有层出不穷的新想法和巨大的热情，且能力和经验也毫不逊色。进入大学以来：平时注意综合素质的全面发展，积极参加学校组织的各项活动。在学习中，态度端正，刻苦努力；在工作中，在完成个人任务的同时，也能协助主席团完成信息的上传和下达工作，并按实际情况给各部门分配好任务，以保证工作可以保质保量地完成。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc51c5e1e6.jpg-tinyq30', '1', '重庆医药高等专科学校学生会副主席'),
(297, '贺良爽', 22, '贺良爽，男，共青团员，重庆医药专科高等学校药学专业2014级专科生，现任重庆医药高等专科学校社团联合会主席，曾在全校12•9演讲获得二等奖，曾被评为全校“优秀共青团员”，在校运动会男子400米获得冠军，曾被评为药学院“优秀干事”，被评为校毅跆拳道社“优秀学员”，曾被评为医专达人秀“医专达人奖”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc58d97b15.jpg-tinyq30', '2', '重庆医药高等专科学校社团联合会主席'),
(298, '赵莹', 22, '赵莹，女，共青团员，重庆医药高等专科学校护理专业2014级专科生，现任重庆医药高等专科学校团委学生副书记。在军训期间，因表现突出，被评为“优秀学员”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc5eb11b1a.JPG-tinyq30', '2', '重庆医药高等专科学校团委学生副书记'),
(304, '秦晓凤', 23, '秦晓凤，女，共青团员，重庆三峡医药高等专科学校护理专业2014级专科生，现任重庆三峡医药高等专科学校团委副书记。曾被评为2014级学生军训活动军训标兵。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc77404c12.png-tinyq30', '3', '重庆三峡医药高等专科学校团委副书记'),
(305, '谭倩霞', 23, '谭倩霞，女，共青团员，重庆三峡医药高等专科学校护理专业2014级专科生，现任重庆三峡医药高等专科学校团委学生会副主席。曾获护理系“校园之春之‘说.写.行’风采大赛”优秀奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc80031e4d.png-tinyq30', '0', '重庆三峡医药高等专科学校团委学生会副主席'),
(306, '张笑', 23, '张笑，男，共青团员，重庆三峡医药高等专科学校药学专业2014级专科生，现任重庆三峡医药高等专科学校团委学生会副主席。曾被评为优秀共青团干部，荣获药学系学生干部风采大赛三等奖，校社团黑八台球比赛优秀奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc869e9e06.png-tinyq30', '0', '重庆三峡医药高等专科学校团委学生会副主席'),
(307, '宋海平', 23, '宋海平，男，共青团员，重庆三峡医药高等专科学校临床医学专业2014级专科生，现任重庆三峡医药高等专科学校团委学生会副主席。曾被评为临床系文艺先进个人。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc8de4107d.png-tinyq30', '0', '重庆三峡医药高等专科学校团委学生会副主席'),
(308, '杨艺', 23, '杨艺，女，共青团员，重庆三峡医药高等专科学校思政教学专业2014级专科生，现任重庆三峡医药高等专科学校团委学生会副主席。曾被评为2014级学生军训活动军训标兵、造血干细胞优秀组织者，荣获国际秘书节之速录比赛优秀奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc90801074.png-tinyq30', '0', '重庆三峡医药高等专科学校团委学生会副主席'),
(309, '郭秋霞', 23, '郭秋霞，女，共青团员，重庆三峡医药高等专科学校药学专业2014级专科生，现任重庆三峡医药高等专科学校团委学生会副主席。曾被评为优秀共青团干部。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc937cc98e.png-tinyq30', '1', '重庆三峡医药高等专科学校团委学生会副主席'),
(310, '胡冰冰', 25, '胡冰冰，女，共青团员，出生于1996年6月，现就读于重庆工业职业技术学院财经学院14营销302班，现担任该校校团委学生会学生副书记。她是一个亦诙亦谐的女孩，落落大方，善于沟通，敢于尝试。她也脚踏实地，追求上进，自入校以来不仅学习成绩优秀，课外生活也非常丰富，积极参加学校、院系的各个活动，其在校期间获奖情况如下： 2014—2015上学年在军事训练中被评为“优秀学员” 2014—2015上学年在菁英学子团干培训中被评为“优秀学员” 2014—2015上学年获财经学院二等奖学金 2014—2015下学年获三月', 'http://redrock.u.qiniudn.com/2015-09-30_560bc9c085e7a.png-tinyq30', '0', '校团委学生会学生副书记'),
(311, '李佳', 25, '李佳，女，共青团员，重庆工业职业技术学院应用化工专业2014级，现任重庆工业职业技术学院校团委•学生会主席一职。曾获得重庆工业职业技术学院2014—2015学年“校团委•学生会”优秀学生干事。重庆工业职业技术学院2014—2015学年第一学期获校内三等奖学金。重庆工业职业技术学院第六期“菁英学子”培训结业证书。 重庆工业职业技术学院首届配音大赛优秀奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bc9f82f89e.png-tinyq30', '0', '重庆工业职业技术学院校团委•学生会主席'),
(312, '傅得曦', 25, '傅得曦，男，共青团员，重庆工业职业技术学院机械工程学院2014级专科生，现任重庆工业职业技术学院学生会副主席。2014年10月，他在机械学院中参加主持人大赛，经过初赛、复赛、决赛，最终成为系部主持人大赛冠军 2014年11月，他参加了学校举办的“菁英学子”团干培训，并获得“优秀学员”荣誉证书 2014年11月，他参加学校的党课培训，并且顺利获得党课结业证书 2014年11月，经过选拔，他被学校选中去中国物理研究院参观学习 2015年1月，经过选拔，他参加了学校的“赴马来西亚公立大学游学”活动。', 'http://redrock.u.qiniudn.com/2015-09-30_560bca66070c4.png-tinyq30', '0', '重庆工业职业技术学院学生会副主席'),
(313, '廖泽凤', 25, '廖泽凤，女，共青团员，出生于1995年10月，现就读于重庆工业职业技术学院财经学院14酒店301班，现担任该校校团委学生会副主席。乐于助人，善于沟通，敢于尝试，入校来学习成绩优秀，曾荣获得重庆工业职业技术学院2014—2015学年“校团委•学生会”优秀学生干事。重庆工业职业技术学院2014—2015学年第一学期获校内二等奖学金。重庆工业职业技术学院第六期“菁英学子”培训结业证书，重庆工业职业技术学院营销技能大赛优秀奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bca91a7540.png-tinyq30', '0', '校团委学生会副主席'),
(314, '刘疆', 25, '刘疆，男，共青团员，出生于1994年9月，现就读于重庆工业职业技术学院车辆工程学院14汽整301班，担任班级学习委员，同时也是校团委学生会副主席。自入校以来，严格遵守学校的各项规章制度，做好模范带头作用，平时能够妥善处理好班级与学生会工作之间的关系，在思想、学习、工作等方面取得了较大的进展。 积极参加学生会的每一次活动，认真思考，不断总结提高自身的思想政治水平，并把大学作为了培养、锻炼、发展自我的平台，时刻用高标准来约束自身，一步一步朝着新的目标前进！ 时刻铭记自己是一个光荣的学生会成员，处处严格的要求自', 'http://redrock.u.qiniudn.com/2015-09-30_560bcac9137a9.png-tinyq30', '0', '校团委学生会副主席、班级学习委员'),
(315, '向如意', 30, '向如意，男，共青团员，重庆机电职业技术学院汽车检测与维修技术（运输与管理方向）2014级学生，现任重庆机电职业技术学院学生会主席团候选人。曾在重庆机电职业技术学院2014-2015学年“五四”表彰中评选为“优秀共青团员”、首届学生干部技能大赛三等奖、学院“学生说学”活动优胜奖、第四届田径运动会“先进工作者”荣誉称号等校级表彰6次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bcbacdcf3f.png-tinyq30', '9', '重庆机电职业技术学院学生会主席团候选人'),
(316, '施汶妤', 30, '施汶妤，女，共青团员，重庆机电职业技术学院数控技术专业2014级专科生，现是重庆机电职业技术学院学生会主席团候选人。曾在“正和岛”第二届大学生职场模拟招聘大赛被评为“优秀志愿者”，被学院评为“优秀共青团员”，获得第四届田径运动会“优秀先进工作者”荣誉称号等校级表彰4次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bccb5c5267.jpg-tinyq30', '5', '重庆机电职业技术学院学生会主席团候选人'),
(317, '李鑫', 30, '李鑫，男，共青团员，重庆机电职业技术学院2014级汽车检测与维修技术。现任重庆机电职业技术学院院学生会主席团候选人。曾荣获，学院“大学生职业规划大赛”优胜奖，荣获优秀学生综合素质奖学金一等奖，优秀共青团员，第四届田径运动会“优秀先进工作者”荣誉称号等校级表彰5次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bcd0dede0b.png-tinyq30', '9', '重庆机电职业技术学院院学生会主席团候选人'),
(318, '刘宇', 30, '刘宇，男，共青团员，重庆机电职业技术学院2014级汽车技术服务与营销专业。现任重庆机电职业技术学院院学生会主席团候选人。曾荣获，首届学生干部技能大赛一等奖，学院“学生说学”活动优胜奖，荣获三好学生，优秀共青团员，优秀学生综合素质奖学金等校级表彰6次。', 'http://redrock.u.qiniudn.com/2015-09-30_560bcdd2a4cf7.jpg-tinyq30', '6', '重庆机电职业技术学院院学生会主席团候选人'),
(319, '谭千银', 30, '谭千银，女，共青团员，重庆机电职业技术学院会计与审计专业2014级专科生，现任重庆机电职业技术学院学生会主席团候选人。曾被评为2014-2015学年“五四”表彰中评选为“优秀共青团员”、在2014级新生军训中评为“优秀学员”，在第四届田径运动会中别评为”体育道德风尚先进个人“及“先进工作者”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bcf1108ee9.png-tinyq30', '7', '重庆机电职业技术学院学生会主席团候选人'),
(320, '汪欣', 14, '汪欣，女，中共预备党员，长江师范学院思想政治教育（师范）专业2013级本科生，现任校团委（学生）副书记、校学生会副主席。历任校团委组织部干事、副部长，大学生就业服务中心办公室主任，班级团支部书记。曾获国家励志奖学金，校级一等奖学金，重庆市“正和岛”杯第二届大学生职场模拟招聘大赛三等奖，校学生干部“说、写、行”大赛二等奖等荣誉及校级“自立自强先进个人”、“优秀共青团干部”等荣誉称号。', 'http://redrock.u.qiniudn.com/2015-09-30_560bcfa4c1e91.jpg-tinyq30', '2', '校团委（学生）副书记、校学生会副主席'),
(321, '周金山', 33, '周金山，女，共青团员，重庆工商职业学院旅游与文化学院酒店管理专业2014级学生。现任工商职业学院校团委学生副书记。大学期间我获得过： 1、2014年军训心得体会评比活动中荣获“三等奖” 2、2015年重庆工商职业学院职场模拟招聘大赛“一等奖” 3、学生干部培训辩论赛荣获“优秀辩手” 4、2014年新年晚会中被评为“先进个人”', 'http://redrock.u.qiniudn.com/2015-09-30_560bd18bef141.jpg-tinyq30', '6', '校团委学生副书记'),
(322, '余世华', 33, '余世华，男，共青团员，重庆工商职业学院金融与证券2014级学生，现任重庆工商职业学院学生会主席。大学以来一直遵守学校纪律，严格要求自己、积极上进，通过加入学生会、社团组织，参加党课、学校讲座、活动、竞赛等从而使自己在思想、责任感、能力、知识量等多方面快速提升。自入校以来获得：区优秀志愿者、校军训标兵（优秀学员）、校军训心得征文（二等奖）、校优秀学生干部、院优秀班干部，也斩获校运动会800个人三等奖,4*400二等奖，院合唱比赛一等奖等。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd1ebe11c9.jpg-tinyq30', '5', '重庆工商职业学院学生会主席');
INSERT INTO `president` (`id`, `president`, `school_id`, `introduce`, `pic`, `praise`, `posization`) VALUES
(323, '郑美清', 33, '郑美清，女，共青团员，重庆工商职业学院旅游管理专业2014级学生，现任重庆工商职业学院学生会副主席。自2014年入校以来，严格遵守学校的各项规章制度，做好模范带头作用，在思想、学习、工作等方面取得较大的进展。在班级管理、开展团日活动等各方面取得了一定成绩，赢得了班级同学的一致好评，举办的团日活动获得了院评比“优秀团日活动”的称号。 并积极参加学校举办的运动会、新年晚会、演讲比赛等等活动，并在今年5月参加“校园模特大赛”荣获第一名。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd241b0b0f.jpg-tinyq30', '6', '重庆工商职业学院学生会副主席'),
(324, '王磊', 35, '王磊，男，共青团员，重庆财经职业学院会计专业2014级专科生，现任重庆财经职业学院校学生会主席。曾担任重庆财经职业学院2015暑期三下乡创新创业团团长。曾出演话剧《雷雨》在“市商委2015年共青团表彰大会暨中国梦•青春梦”荣获第一名。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd412bf9c3.jpg-tinyq30', '4', '重庆财经职业学院校学生会主席'),
(325, '邵园', 35, '邵园，共青团员，重庆财经职业学院会计专业2014级专科生，现担任重庆财经职业学院校学生会副主席。曾获重庆财经职业学院2014-2015级优秀团干部，第二十八期业余团校优秀学员。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd4662256e.jpg-tinyq30', '3', '重庆财经职业学院校学生会副主席'),
(326, '肖晓', 35, '肖晓，共青团员，重庆财经职业学院市场营销专业2014级专科生，现任重庆财经职业学院校学生会副主席。曾获第二十八期业余团校优秀学员。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd5ab6aca5.jpg-tinyq30', '3', '重庆财经职业学院校学生会副主席'),
(327, '陈豪', 35, '陈豪，共青团员，重庆财经职业学院财务管理专业2014级专科生，现任重庆财经职业学院校学生会副主席。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd65408e65.jpg-tinyq30', '3', '重庆财经职业学院校学生会副主席'),
(328, '夏小涵', 35, '夏小涵，共青团员，重庆财经职业学院会计专业2014级专科生，现担任重庆财经职业学院校学生会副主席。曾获重庆财经职业学院2014-2015级会计系优秀团干部：2014-2015级共青团优秀团员；第二十八期业余团校优秀学员。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd6fa61f8c.jpg-tinyq30', '5', '重庆财经职业学院校学生会副主席'),
(329, '刘雨龙', 31, '刘雨龙，男，汉族，1995年7月出生，团员，重庆水利电力职业技术学院水利工程水政水管理系13级学生，现担任重庆水利电力职业技术学院学生会主席一职。以下为曾在学院中获得过的殊荣。 2013年： 9月：申请加入院团委青年志愿者联合会，并最终面试成功成为外务部一员。 10月：组织志愿者并亲身参与到阳光尚城市民学校活动中。 11月：组织青年志愿者联合会支队建立及招新仪式。 12月：组织院内志愿者开展“冬日送暖”赠衣活动。 2014年： 3月：组织院内志愿者及众多同学参加“学雷锋，树新风”系列主题志愿者活动。例如：', 'http://redrock.u.qiniudn.com/2015-09-30_560bd92514eb3.jpg-tinyq30', '0', '重庆水利电力职业技术学院学生会主席'),
(330, '庞茜', 31, '庞茜，女，共青团员，重庆水利电力职业技术学院建筑工程技术专业2013级专科生，现任水电学院学生会副主席。曾被评为“三下乡”社会实践先进个人，2013年11月荣获学院“主持人风采大赛”第二名，2014年5月荣获学院“优秀团员”称号，2014年6月荣获学院“建筑模型大赛”二等奖，2014年6月荣获“重庆市第五届大学生成长论坛”青爱微课堂讲课比赛学会三等奖，2014年11月荣获学院“一等奖学金”，2014年12月荣获学院“三好学生”称号，2014年12月荣获国家“励志奖学金”，2015年荣获学院“优秀团干”称号', 'http://redrock.u.qiniudn.com/2015-09-30_560bd9832095c.png-tinyq30', '0', '水电学院学生会副主席'),
(331, '蔡积彬', 31, '蔡积彬，男，中共党员，重庆水利电力职业技术学院水利水电建筑工程专业2013级专科生，现任重庆水利电力职业技术学院学生会副主席，生活权益部部长和班级团支书。曾被评为重庆市“三下乡”社会实践先进个人，“校优秀学生干部”，“校优秀团干部”。1993年4月出生于广东省茂名市电白县，2003—2007年就读于新陂小学，2007—2010年就读于电白县第二中学，2010年—2013年就读于电白县实验中学，曾被评为电白县“志愿服务行动先进个人”、“三好学生”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bd9c67e488.jpg-tinyq30', '0', '重庆水利电力职业技术学院学生会副主席，生活权益部部长和班级团支书'),
(332, '桂湄', 81, '桂湄，女，共青团员，重庆航天职业技术学院会计电算化2014级专科生，现任重庆航天职业技术学院团委副书记。曾获得基础学院“办公室副主任”、“优秀志愿者”等奖项。', 'http://redrock.u.qiniudn.com/2015-09-30_560bda4abaeb6.png-tinyq30', '0', '重庆航天职业技术学院团委副书记'),
(333, '王大鹏', 81, '王大鹏，男，共青团员，重庆航天职业技术学院管理工程系会计电算化二班学生，现任重庆航天职业技术学院学生会主席。曾被评为军训优秀学员，2014-2015学年受聘为重庆航天职业技术学院基础学院副主席。', 'http://redrock.u.qiniudn.com/2015-09-30_560bda77b4ddc.png-tinyq30', '2', '重庆航天职业技术学院学生会主席'),
(334, '池安', 81, '池安，女，入党积极分子，重庆航天职业技术学院管理工程系工程造价2014级学生，现任重庆航天职业技术学院学生会副主席。曾获得军训“优秀学员”、管理系“年度优秀人物”、重庆航天职业技术学院第四届职业生涯规划设计大赛一等奖、重庆航天职业技术学院“三好学生”、国家励志奖学金、曾担任“办公室副主任”一职。', 'http://redrock.u.qiniudn.com/2015-09-30_560bda9f17968.png-tinyq30', '4', '重庆航天职业技术学院学生会副主席'),
(335, '王江银', 81, '王江银，男，共青团员，重庆航天职业技术学院机电工程系2014级专科生，现任重庆航天职业技术学院学生会副主席。曾获得“12.9 赤子心，中华情”演讲比赛二等奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdad822b2a.png-tinyq30', '0', '重庆航天职业技术学院学生会副主席'),
(336, '李林', 21, '李林，男，预备党员，重庆电力高等专科学校发电厂及电力系统专业2013级专科生，现任重庆电力高等专科学校学生会主席。曾被评为优秀学生干部，获国家励志奖学金、重庆市第三十四届校园之春“职场挑战杯”一等奖。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdb77bf233.png-tinyq30', '0', '重庆电力高等专科学校学生会主席'),
(337, '伍定越', 21, '我叫伍定越，现就读于电力高等专科学校14级电厂热能动力装置专业。在一年的学习中，我踏实努力，取得了专业第一的优异成绩，荣获“2014-2015学年一等奖学金”，并通过了高等学校英语应用能力三级考试。在工作中，曾任校学生会实践部干事，组织参与一系列志愿服务活动，获得“中国注册志愿者”证书，并凭借优异工作表现荣获“2014-2015学年校学生会工作之星”。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdbf981c2c.png-tinyq30', '0', '校学生会副主席'),
(338, '刘林', 21, '我的名字刘林，我的专业是火电厂集控运行专业，经过半学期的锤炼，在各个方面都有所提高。 在校期间，我曾获得过一等奖学金、优秀学员、部门工作之星。我对所学专业有着极大的兴趣与爱好，掌握了现阶段应具有的基本知识，并努力地将理论知识运用到实践中去。同时顺利地通过了计算机一级的等级考试，对Windows操作系统和Office办公软件的运用十分熟练。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdc6585d10.png-tinyq30', '0', '校学生会副主席'),
(339, '彭增', 21, '彭增，女，共青团员，重庆电力高等专科学校电力工程学院发电厂及电力系统2班在校专科生，现任重庆重庆电力高等专科学校学生会副主席。在入学军训中被评“先进个人“，大一上下学期均荣获”一等奖学金“，在校期间积极参加校运会荣获女子100米第五名，积极参加校组织的羽毛球比赛荣获女子组第三名，荣获电力工程学院”学习之星“。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdd39e418d.png-tinyq30', '0', '重庆电力高等专科学校学生会副主席'),
(340, '汪洋', 2, '汪洋，男，中共党员，西南大学数学与应用数学2013级本科生，现任西南大学学生会副主席、数学与统计学院团委学生会主席。曾获国家奖学金、明德奖学金、第十四届重庆市挑战杯特等奖、西南大学含弘杯一等奖，第九届“重庆新世纪教育”杯数学建模竞赛一等奖，第八届“重庆新世纪教育”杯数学建模竞赛二等奖。先后被评为西南大学2013级本科生军训优秀学员、中共西南大学委员会党校2013学年度第一期入党积极分子培训班优秀学员、2013-2014年度“三好学生”、2014年大学生暑期“三下乡”社会实践活动先进个人、民族团结进步先进个', 'http://redrock.u.qiniudn.com/2015-09-30_560bddd58ffd0.jpg-tinyq30', '12', '西南大学学生会副主席、数学与统计学院团委学生会主席'),
(341, '王立伟', 3, '王立伟，女，共青团员，西南政法大学法学专业2012级本科生，现任西南政法大学学生会副主席。曾被评为西南政法大学社会实践先进个人，西南政法大学“三下乡先进个人”，西南政法大学军训优秀学员，民商法学院社会实践先进个人，曾获“创青春”重庆市铜奖、西南政法大学校级二等奖，完成重庆市级科研项目一项。', 'http://redrock.u.qiniudn.com/2015-09-30_560bde2c2d300.jpg-tinyq30', '0', '西南政法大学学生会副主席'),
(342, '骆晗', 5, '骆晗，女，共青团员。重庆师范大学马克思主义学院思想政治教育专业2013级本科生，现任重庆师范大学学生会副主席。曾被评为重庆师范大学“优秀共青团员”“优秀学生干部”“优秀志愿者”等等。作为一名学生干部，一直秉持着“耐心做事，创新方法，用心对人”的理念，同时积极参加各类活动，提升自身综合素质，坚持学习与学生工作两不误，活出新时代大学生的风采！', 'http://redrock.u.qiniudn.com/2015-09-30_560bdeb6f3c75.png-tinyq30', '0', '重庆师范大学学生会副主席'),
(343, '窦依琳', 5, '窦依琳，女，共青团员。重庆师范大学数学学院数学与应用数学专业2013级本科生，现任重庆师范大学学生会副主席。曾被评委重庆师范大学“优秀团干部”“先进个人”“优秀志愿者”等等。作为一名学生干部，我一直以“在其位，谋其政；任其职，尽其责”为原则，积极参加各种活动，完善自我的同时为学校的发展贡献自己最大的力量。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdef465f06.png-tinyq30', '1', '重庆师范大学学生会副主席'),
(344, '刘悦婷', 7, '刘悦婷，女，河北唐山人，经济与管理学院2013级工程造价专业，现任校团委办公室干部、重庆交通大学学生会副主席。曾获校级社会实践奖项,市级、校级创新创业训练奖项。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdf3f9f7fc.png-tinyq30', '1', '校团委办公室干部、重庆交通大学学生会副主席'),
(345, '赵填椋', 7, '赵填椋，男，云南大理人，重庆交通大学工程管理专业2013级学生，现任校团委办公室干部、重庆交通大学学生会副主席。曾被评委重庆交通大学优秀学生干部、重庆交通大学精神文明先进个人等。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdf667517e.png-tinyq30', '0', '校团委办公室干部、重庆交通大学学生会副主席'),
(346, '简传熠', 7, '简传熠，男，重庆永川人，重庆交通大学理论与用力学专业2013级本科生，现任重庆交通大学校团委组织部干部、重庆交通大学学生会副主席。曾被评为重庆交通大学“优秀学生干部”、“优秀共青团干部”、“青马工程”培训班先进个人等荣誉。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdf8b6483c.png-tinyq30', '0', '重庆交通大学校团委组织部干部、重庆交通大学学生会副主席'),
(347, '程钰杰', 7, '程钰杰，男，重庆万州人，重庆交通大学机械设计制造及其自动化专业2013级本科生，现任重庆交通大学常务副主席。曾任重庆交通大学德园小区团委学生会副主席。', 'http://redrock.u.qiniudn.com/2015-09-30_560bdfea6b916.png-tinyq30', '0', '重庆交通大学常务副主席'),
(348, '轩琳芸', 8, '轩琳芸，女，共青团员，重庆工商大学电子信息工程专业2013级本科生，现任重庆工商大学学生会副主席。曾被评为重庆市第四届大学生艺术展演活动先进个人、重庆工商大学优秀团员、&quot;36182&quot;大学生素质拓展工程标兵。', 'http://redrock.u.qiniudn.com/2015-09-30_560be08e0d851.jpg-tinyq30', '1', '重庆工商大学学生会副主席'),
(349, '肖必娅', 12, '肖必娅，女，中共预备党员，重庆三峡学院信息管理与信息系统专业2013级本科生，现任重庆三峡学院学生会副主席，曾被评为&quot;优秀共青团员&quot;&quot;优秀共青团干部&quot;“三好学生”“自立自强先进个人”。', 'http://redrock.u.qiniudn.com/2015-09-30_560be0ca0701f.jpg-tinyq30', '0', '重庆三峡学院学生会副主席'),
(350, '徐琳', 24, '徐琳，女，共青团员，重庆电子工程职业学院材料工程专业2013级学生，现任重庆电子工程职业学院团委书记助理。曾被评为重庆市大学生骨干培训“优秀学员”、重庆市“文明美德校园行”演讲比赛第二名、重庆电子工程职业学院第十一届田径运动会“优秀志愿者”，重庆电子工程职业学院“优秀共青团干部”、重庆电子工程职业学院“优秀共青团员”、重庆电子工程职业学院“优秀学生干部”、重庆电子工程职业学院系精品团辩论赛“最佳辩手”等。', 'http://redrock.u.qiniudn.com/2015-09-30_560be1db4a8c5.jpg-tinyq30', '1', '重庆电子工程职业学院团委书记助理'),
(351, '袁方', 29, '袁方，女，共青团员，重庆工贸职业技术学院鞋类设计与工艺专业2013专科生，现任重庆工贸职业技术学院学生会秘书长，作为学生会秘书长她不断拓宽工作领域，创新工作模式，改进工作方法，促进同学德、智、体全面发展。做到学生会是为同学服务的窗口，是老师与同学沟通.交流的纽带。同时，她也积极参与学院组织的“青马工程”培训中，认真学习马列主义，毛泽东思想，邓小平理论，“三个代表”，“科学发展观”，“八荣八耻”等重要的党的指导理论和思想。并且将这些理论理解与平日的实践结合，在思想上、生活上和行动上严格要求自己。积极向党组织', 'http://redrock.u.qiniudn.com/2015-09-30_560be25fa1320.png-tinyq30', '2', '重庆工贸职业技术学院学生会秘书长');
