(1, '重庆大学', '', 0, '', 0),
(2, '西南大学', '西南大学学生会是在校党委领导，校团委的指导下的学生组织，是联系学生和学校的重要纽带。这里有一批经过严格筛选的品学兼优、工作能力较强、作风优良的学生干部。他们本着&quot;服务同学、锻炼自我&quot;的宗旨，有机地组成学校的整体，为繁荣师生文化、丰富学生生活、促进校园建设做出自己的努力，并卓有成效的做了大量工作，成为校园工作、生活的中坚力量。我校学生会主动适应形势要求、时刻把握时代脉搏，在实践中研究新问题、探索新思路、拓展新途径，提高新层次、打造新品牌。树立牢固的工作意识，以改革为动力，以载体促活跃，以创新求发展，培养青年学生的创新精神、创业意识和实践能力；并全面加强学生会自身建设，团结、引导、带领广大同学，有效的服务于西南大学青年学生的成长成才。', 58, 'http://redrock.u.qiniudn.com/2015-09-28_5608c9de4d195.png?imageView2/0/w/1400', 1),
(3, '西南政法大学', '西南政法大学学生会成立于1953年，在西南政法大学党委的领导下和校团委指导下，经过一代代干部们的兢兢业业、自强不息地辛劳耕耘，如今的校学生会已经发展成中国西部乃至全国高校最优秀的学生组织之一。 学生会始终本着“一切为了同学，求索完善自我”的宗旨，坚持自我服务、自我教育、自我管理、自我完善，从而更好地引导同学、发展同学、代表同学、服务同学，并将我党的大政方针、会议精神以及我校校训同学生会的具体实践相结合，创办了“感动校园——西政学子年度人物”颁奖典礼、“践行先锋”、毓秀议苑、3V3篮球嘉年华系列活动、十大歌手等精品活动。 作为伟大的党的后备军，校会必将不断进取，以校园文化建设为使命，开拓创新，积极开展丰富多彩、意义深厚的活动和服务，引领学生思想，充分践行社会主义核心价值观。', 19, 'http://redrock.u.qiniudn.com/2015-09-28_5608ca0eb93fd.jpg?imageView2/0/w/1400', 1),
(4, '重庆医科大学', '重庆医科大学学生会是在校党委领导、团委指导下的全校性学生组织，是学校联系学生的重要桥梁和纽带。重庆医科大学学生会坚持以“服务同学，成就自我”为宗旨，自成立以来创新和打造了医学专业志愿者活动、医学专业辩论赛、社团文化节、星空音乐节等一系列校园精品文化活动，并形成了独具特色的学生权利维护体系，曾多次获得重庆市优秀学生会等表彰。    重庆医科大学学生会包含青年志愿者联盟、学生社团联合会、学生自律委员会等8个学生组织，设有办公室、财资部、学习部、心理健康部等8个部门，各组织部门昂扬进取，紧密合作，构建起有活力、有能力、负责任的学生会。重庆医科大学学生会为维护学生的合法权益、引导学生发展、推动校园文化建设做出了积极贡献。', 11, 'http://redrock.u.qiniudn.com/2015-09-28_5608cabde7d89.png?imageView2/0/w/1400', 1),
(5, '重庆师范大学', '重庆师范大学学生委员会是在校党委和市学联领导下、校团委指导下的以服务同学为根本宗旨的学生组织。它既是广大学生利益的忠实代表，也是学校和同学之间的桥梁和纽带。秉承着“自我管理，自我教育，自我服务”的指导方针。我们结合师范院校专业特色，在服务全校师生的同时，打造了一些精品项目，并向着“团结同学、塑造同学、带领同学”努力建设学生会的灵魂，以科学合理的管理模式更好地服务于全校。重庆师范大学学生委员会由主席团及其下设的11个部门和志工总队所构成。它们分别是办公室、自律委、学习部、生活部、宣传部、体育部、权益部、女生部、外联部、心理部和文娱部。主席团设主席1名、副主席5名，各部门设部长1名、副部长3到4名。主席团对整个学生会负责，主席对主席团负责，各副主席对所分管部门负责，各部部长分别对各部门负责。学生会的一切重大决议需由主席团讨论通过后方能公布并实施。', 13, 'http://redrock.u.qiniudn.com/2015-09-28_5608ca7f53c66.png?imageView2/0/w/1400', 1),
(6, '重庆邮电大学', '重庆邮电大学学生会是由校党委、市学联领导，由校团委具体指导的群众性组织。本着“全心全意为同学服务”的宗旨扎根学生群体，坚持服务同学个性成长，以自我教育、自我管理、自我服务的 “三自作用”激发学生主体精神。以“四个一”素质提升活动（培养一类文艺爱好、养成一个运动习惯、坚持一项志愿服务、提升一项表达能力）推动学校学生活动开展。举办 “信科杯”辩论赛、“十大歌手”“重邮梦想秀”、 “运动吉尼斯”、“主持人大赛”等校园活动不断加强青年学生思想政治教育，努力促进和谐校园文化建设。竭诚服务同学，解决同学实际困难。反映同学诉求，提升学生参与学校民主管理能力。同时学生会加强了学院党政、职能部门和各学院与同学间的沟通与联系。 目前共设13个部门：办公室、学习部、宣传部/新媒体运营部、人力发展部、提案部/自律权益部、生活服务部、文娱部、体育部、女生部、外联部、文化创意部、项目管理部、主持部。', 25, 'http://redrock.u.qiniudn.com/2015-09-28_5608cb1dd24e8.jpg?imageView2/0/w/1400', 1),
(7, '重庆交通大学', '重庆交通大学学生会是在学校党委和市学联领导下，在校团委的指导下，自我教育，自我管理，自我服务的学生群众组织，是引领学生先进思想的主力军，是推进校园文化建设的生力军，是维护全校学生合法权益的重要声音和力量，是学校和学生进行联系和交流的纽带。 重庆交通大学学生会参加中华全国学生联合会和重庆市学生联合会，为其团体会员，并为重庆市学生联合会副主席单位。自成立数十年来，重庆交通大学学生会通过在思想引领、社会实践、科技创新、校园文化、维护权益等五大平台上的辛勤工作，带领和团结全校三万多名青年学生以主人翁的姿态，为重庆交通大学的改革、发展、稳定和一代又一代学子的成长做出了不懈的努力。', 9, '', 1),
(8, '重庆工商大学 ', '重庆工商大学学生会是在重庆工商大学党委领导、校团委具体指导下，代表学校广大学生权益的学生群众组织。自2003年成立以来，始终坚持以“全心全意为学生的成长成才服务，团结带领广大学生为学校的改革发展贡献力量”为中心工作，按照校团委提出的“指导思想明确、工作思路要清晰、工作品牌要形成、工作重点要突出、工作机制要创新、工作方法要科学”等六点要求，遵循“自我教育、自我管理、自我服务”的原则，秉承“以服务谋生存，以创新求发展”的工作理念，以实际行动践行“凝聚学生”、“引领学生”、“服务学生”、“保护学生”，努力把学生会建设成“同学之家、师生之桥、干部之校”。', 7, '', 1),
(9, '重庆理工大学', '重庆理工大学学生会是在重庆理工大学校党委领导，校团委具体指导下，组织在校本科生和专科生进行自我教育、自我服务、自我管理的群众性学生组织，是我校规模最大、机制最为健全、影响最深的学生组织，也是学校学生自我管理的最高机构，代表和维护了广大学生的根本利益。', 4, 'http://redrock.u.qiniudn.com/2015-10-04_5610c4c51074c.png?imageView2/0/w/1400', 1),
(10, '四川外国语大学', '四川外国语大学学生委员会是在市学联、校党委领导下，在校团委指导下开展学生工作的学生自治组织。我校学生会下设主席团、秘书处、文体部、公关部、信宣部、生活部、学习部。我校学生会以“关注同学、走近同学，了解同学、服务同学”为宗旨，组织承办各种校园文化活动，丰富同学们的第二课堂，服务学生的学习与生活，维护学生正当权益，引领校园先进风尚，培养具有青年领导力、社会责任感、全面高素质的新一代大学生。', 5, 'http://redrock.u.qiniudn.com/2015-09-28_5608cb81ed958.jpg?imageView2/0/w/1400', 1),
(11, '四川美术学院', '四川美术学院校学生会是校团委直接领导下的，独立自主开展各种学生工作以及各种丰富学生课余生活的活动。作为代表学校最官方的学生组织，校学生会一直致力于引导学生进行自我管理，自我提高。校学生会在主席团的领导下现共设有：团委组织部，团委宣传部，办公室，文体部，学习部，女生部，新媒体部，社会实践部，青年志愿者协会和川流不息杂志社。同时拥有新浪认证官方微博“四川美术学院学生会”以及微信订阅号“乐活川美”两大网络宣传平台互动更新学校最新动向', 5, '', 1),
(12, '重庆三峡学院', '重庆三峡学院学生会是校党委、市学联领导下全校学生的群众性组织。在校团委的指导下开展工作,是广大同学利益的忠实代表；是联系学校党政与广大同学的桥梁纽带。校学生会坚持“团结、奋进、务实、创新”的原则，以“全心全意为同学服务”为根本宗旨，紧紧围绕学校的工作重心，全面提高同学综合素质，开展各种丰富多彩的校园活动，团结和带领广大同学在学习和实践中成长、成才。校学生会下设主席团、办公室、组织部、团委宣传部（新媒体建设中心、大学生通讯社）、社会实践与对外联络部、文体活动部、大学生自律委员会（学习部、生活部、纪检部）7个部门。各部门互相协调，互相合作，在个团体的成员素质不断提高。校学生会也在工作过程中得到不断发展、壮大。', 7, 'http://redrock.u.qiniudn.com/2015-09-30_560ba1013164c.jpg?imageView2/0/w/1400', 1),
(13, '重庆文理学院', '重庆文理学院学生会是在重庆文理学院党委领导，团委指导下的学生组织，与团委会、学生社团联合会一同构成重庆文理学院“三委会”。成立至今，我校学生会在“进德修业 博文达理”校训的指引下，秉着服务师生、维护广大同学利益的理念，充分发挥联系老师与同学的纽带作用，为广大同学提供了展示自身风采的广阔舞台。校学生会是全校人才荟萃的地方，也是培养优秀人才的摇篮，为了更好地发挥其自我服务、自我教育、自我管理的职能，校学生会根据其工作性质分为办公室、学习部、外联部等8个部门。今日的校学生会生机勃勃，勇于进取，形成了自己的优良传统和工作特色，致力于为我校广大学生创造良好的学习环境和生活环境。', 23, 'http://redrock.u.qiniudn.com/2015-10-04_5610c37b53549.jpg?imageView2/0/w/1400', 1),
(14, '长江师范学院', '长江师范学院学生会是在长江师范学院党委领导下、团委具体指导帮助下的全校性学生自治组织。共设19个部门（含团委直属部门），分别为：主席团、办公室，团委社会实践与外联部、组织部、学术科技部、文艺部、网络部、礼仪部和国旗班；学习部、体育部、宿管部、生活部、纪检部、社会工作部、女工部、通讯社、权益维护中心、心理发展部和新媒体中心。 长江师范学院学生会坚持“引导同学、发展同学、代表同学、服务同学”的工作理念，以“明使命、勇担当、重奉献、求卓越”的精神为宗旨，紧跟时代砥砺前行，担当责任奋发有为，做同学的青春引航人、知心人和圆梦人。校会始终坚定党的政治领导、思想领导、组织领导，将在校团委的指导帮助下，为把长江师范学院学生会建设成同学向往、老师称赞、同行知名的精神家园而努力奋斗。', 6, 'http://redrock.u.qiniudn.com/2015-09-28_5608cc396c24c.jpg?imageView2/0/w/1400', 1),
(15, '重庆科技学院', '', 0, '', 0),
(16, '重庆第二师范学院', '重庆第二师范学院学生会是在重庆第二师范学院党委领导，团委指导下进行自我教育、自我管理、自我服务的群众性学生组织，旨在服务青年、影响青年，是学生和学校各部门间联系的桥梁和纽带，是培养大学生全面成才的重要载体。   重庆第二师范学院学生会由主席团负责日常事务，并在主席团下设有十个职能部门：办公室、生活部、文体部、外联部、礼仪部、宣设部、学风建设部、宿舍管理中心、就业创业部、校友自愿者工作部。在主席团的带领下，各部门努力向着服务型、公益型、活动型、维权型等的学生会发展。在各项工作中，各部门本着“分工不分家”的原则，相互协调、相互合作、全面服务学生。', 4, 'http://redrock.u.qiniudn.com/2015-09-29_560a8e06abf41.jpg?imageView2/0/w/1400', 1),
(17, '重庆警察学院', '重庆警察学院学生会是校党委领导、校团委指导下的代表广大同学基本利益的学生自治组织，是联系学生与学校的桥梁和纽带。学生会以“自我教育、自我管理、自我服务”为工作理念，紧密围绕学校建设西部一流公安院校宏伟目标，大力开展相关工作，同时结合学院实际，积极配合团市委、市学联开展各项工作，有力助推我院学子成长成才， 校学生会主席团共5人，包括主席1名、副主席4名，秘书长由校团委老师担任，共设有办公室、警务化管理委员会、编辑部、学习部、体育部、文娱部、生活部、女生部、礼宾礼仪部9个职能部门，每部门均设部长1名，副部长2名，干事4-6人。同时下设侦查大队、治安大队、刑技大队、交管大队、战术大队共5个二级学生会。', 63, 'http://redrock.u.qiniudn.com/2015-09-30_560ace6757e7d.jpg?imageView2/0/w/1400', 1),
(18, '第三军医大学', '', 0, '', 0),
(19, '后勤工程学院', '', 0, '', 0),
(20, '解放军重庆通信学院', '', 0, '', 0),
(21, '重庆电力高等专科学校', '重庆电力高等专科学生会是在重庆电力高等专科学校党委领导、团委指导下以党的教育方针为方向，促进同学德智体全面发展，团结和引导同学成为现代化建设事业要求的合格人才，并发挥作为学校和老师联系同学的桥梁和纽带作用。倡导和组织同学们自我服务、自我管理、自我教育，开展健康有益，丰富多彩的课外活动，努力为同学服务。校学生会作为最庞大的组织，设有最全面的部门：办公室、实践部、学习部、体育部、文娱部、生活部、就业部。以在服务中成长，在耕耘中收获为主旨，建成了广受学校和师生信任，富有生机而温馨的大家庭。', 4, 'http://redrock.u.qiniudn.com/2015-09-30_560acbb5e4f0e.jpg?imageView2/0/w/1400', 1),
(22, '重庆医药高等专科学校', '', 3, 'http://redrock.u.qiniudn.com/2015-10-04_56107c015dc27.jpg?imageView2/0/w/1400', 1),
(23, '重庆三峡医药高等专科', '重庆三峡医药高等专科学校团委学生会是在重庆三峡医药高等专科学校党委领导和校团委指导下的大学生群众性自治组织，宗旨是：贯彻执行党的教育方针，发挥“自我管理、自我教育、自我服务”的职能，团结带领广大同学努力学习，开拓进取，成为素质全面、适应社会主义现代化建设需要的优秀人才。学生会来自于同学、服务于同学。它以思想引领为先导、以服务同学为重要内容，以提升同学综合素质为主线，以维护同学权益为突破，是联系学生与学校的桥梁和纽带，是发展与繁荣校园文化的舞台和基地，是服务大学生全面成才的重要载体。这里也是让每一位同学发挥聪明才智、展示自我、释放青春活力的炫色舞台；是不断磨砺能力、完善自我、完成升华的大课堂；是同学们共叙友谊、共谋发展、共创辉煌的大家庭。', 5, 'http://redrock.u.qiniudn.com/2015-09-29_560aa917911a2.jpg?imageView2/0/w/1400', 1),
(24, '重庆电子工程职业学院', '重庆电子工程职业学院学生委员会是由校党委、市学联领导，在校团委具体指导下，组织在校大学生进行自我服务、自我管理、自我教育的学生组织，是我校学生代表大会闭会期间的执行机构，是第二十六届全国学联主席团单位。校学生委员会实行主席团负责制。学生委员会下设办公室、宣传部、组织部、社会实践部、体育部、学习部、信息工作部、文艺部、心理工作部、生活部、学管部、国旗护卫队;同时，配合校团委联系指导校大学生艺术团、二级学院学生委员会等学生组织的日常工作。 一直以来，重庆电子工程职业学院学生委员会秉承“厚德强能，求实创新”的校训，以“自我教育、自我管理、自我服务”为宗旨，发扬“招之能来，来之能战，战之能胜”精神，积极参与学生自主管理和校园建设管理，通过各类活动引领大学生思想潮流、提升大学生综合素质，发挥联系学生和学校的桥梁纽带作用，为大学生提供便捷的服务。积极探索具有我校自身特色的各类校园文化活动，为繁荣师生文化、丰富学生生活、促进校园建设做出自己的努力，打造了如“校园科技文化艺术节”、“才艺之星挑战赛”、“校园十佳歌手赛”、“校园舞蹈大赛”等一系列品牌活动，此外，还卓有成效的做了大量工作，成为校园学习、工作、生活的中坚力量。', 4, 'http://redrock.u.qiniudn.com/2015-09-30_560abdd0306ec.jpg?imageView2/0/w/1400', 1),
(25, '重庆工业职业技术学院', '重庆工业职业技术学院校团委·学生会是在校党委的指导下，在校团委的直接领导下进行自我教育、自我管理、自我服务的群众性学生组织，是广大同学利益的忠实代表和维护者，是学生和学校各部门间联系的桥梁和纽带，是发展与繁荣校园文化的舞台和基地，是培养大学生全面成才的重要载体。校团委·学生会现设十一个部门，其中包含：办公室、组织部、学习部、监察部、生活部、广播站、记者团、外联部、文体部、社实部、宣编部，共有38名学生干部。在各项工作中，各部门间本着“分工不分家”的原则，相互协调、相互合作，全面服务学生学习﹑生活﹑成才的方方面面。重庆职业技术学院校团委学生会是一个具有青春与活力的团学组织，共聚学生会，青春更有味！', 0, 'http://redrock.u.qiniudn.com/2015-09-30_560abc20657a4.jpg?imageView2/0/w/1400', 1),
(26, '重庆城市管理职业学院', '', 4, 'http://redrock.u.qiniudn.com/2015-09-30_560b9ab68ff59.jpg?imageView2/0/w/1400', 1),
(27, '重庆工程职业技术学院', '重庆工程职业技术学院学生会是院党委领导下、受院团委直接指导的学生群众组织，它代表学生利益，负责沟通广大同学与学院的关系，遵循和贯彻党和国家的教育方针，倡导良好的校风、学风，促进学生德、智、体全面发展，实现学生“自我管理、自我约束、自我教育、自我发展。', 3, '', 1),
(28, '重庆三峡职业学院', '', 0, '', 0),
(29, '重庆工贸职业技术学院', '重庆工贸职业技术学院学生会是重庆工贸职业技术学院党委、学生处、团委领导下的学生组织。秉承“厚德、博学、强技、创新”的校训，坚持“服务同学、服务学院；脚踏实地、无私奉献；发扬不怕苦、不怕累精神”的目的和宗旨，服务于全院同学成长成才。倡导和组织“自我服务、自我管理、自我教育”,充分发挥师生间桥梁纽带作用，在维护国家和学院整体利益同时，表达和维护同学的具体利益。团结和引导同学成为热爱祖国、热爱人民，适应有中国特色社会主义现代化建设事业要求的合格人才。 重庆工贸职业技术学院学生会是重庆工贸职业技术学院学生代表大会执行机构，在学生代表大会闭会期间行使部分职责。下设秘书部、学习部、生活部、纪检部、外联部、文体部、女生部、宣传部、伙食管理委员会等九个职能部门，并督促指导二级学生分会工作。', 8, '', 1),
(30, '重庆机电职业技术学院', '共青团重庆机电职业技术学院委员会是在中国共产党重庆机电职业技术学院委员会和上级团委的直接领导下，联系学生与学校的桥梁和纽带。担负着不断巩固和扩大党执政的青年群众基础，结合学院实际，积极配合团市委、市学联开展各项工作。', 20, 'http://redrock.u.qiniudn.com/2015-09-29_560ab21f69303.jpg?imageView2/0/w/1400', 1),
(31, '重庆水利电力职业技术', '重庆水利电力职业技术学院学生会是在学院党委领导和团委指导下的学生群众性组织，倡导和组织广大同学自我服务、自我教育和自我管理，通过开展各种活动，一方面围绕学校的中心工作，为学院的发展和建设贡献自己的青春和力量；一方面，积极营造安定和谐的学习、生活环境，致力于促进广大学子的成长和成才。    重庆水利电力职业技术学院学生会成立至今，坚持在实践中不断学习，勇于接受挑战，大胆改革创新，承担起了思想政治教育、社会实践、志愿服务、科技创新、文化艺术、辩论赛等方面的全院性活动，由学生会主办、承办、协办的许多大型活动已成为校园内的品牌活动，具有广泛的影响力。我院学生会作为学院共青团组织的得力助手，不仅为学院的发展和建设做出了卓越的贡献，而且还培养出了一大批德才兼备的学生干部。 院学生会在团委干部的领导下，设12个部门：学院学生会设有主席团、办公室、文艺部、体育部、社团部、生活部、网络部、外联部、礼仪部、女生部、权益部、勤工助学部。 为了满足广大同学的需要，院学生会的各项建设正在逐步加强和壮大。在此，我们也期待着更多奋发有为的青年学子投身到院学生会的团队中来，为学生会输送新鲜的血液，为学生服务事业做出贡献。 ', 0, '', 1),
(32, '重庆城市职业学院', '', 0, '', 0),
(33, '重庆工商职业学院', '重庆工商职业学院学生会是在共青团重庆工商职业学院委员会的指导下设置的一个学生团体组织。是学校联系学生的桥梁和纽带，也是学校最重要的学生组织之一。它是提倡自我服务，自我管理，自我学习的学生组织，为学校学生和老师提供无偿服务的部门。学生会的任务是在学校共产党组织的领导和共青团组织的指导和帮助下，团结全体同学，贯彻党的教育方针。协助学校举办各项学生活动开展各项学生工作。目前，我校学生会以主席团为领导核心，包括学生副书记一人，学生会主席一人，副主席一人。在主席团以下设数个职能部门，包括办公室、宣传部、组织部、学习部、体育部、文艺部、生活部、广播站、大学生艺术团、女生部、自律部、各部门设部长一名、副部长1名或2名，干事若干名。其中社团联合会、校青年志愿者服务总队、记者站和学生会同属校团委下设学生组织。', 10, 'http://redrock.u.qiniudn.com/2015-09-29_560aaed4b5c5a.jpg?imageView2/0/w/1400', 1),
(34, '重庆青年职业技术学院', '', 0, '', 0),
(35, '重庆财经职业学院', '重庆财经职业学院学生会成立于2007年9月，是在院党委、上级学院领导和团委指导下自主开展工作的全院性学生群众组织。本会始终秉承“全心全意为同学服务”的宗旨，以“同学之家、师生之桥、干部之校”为发展理念，围绕学院党政中心工作，是一支团结、积极、乐观、向上、创新、有能动力、有影响力的学生干部队伍，在学生团体中具有较高的声誉和影响力。', 13, 'http://redrock.u.qiniudn.com/2015-09-30_560b9e1e1bb7c.jpg?imageView2/0/w/1400', 1),
(36, '重庆建筑工程职业学院', '我院学生会是在党委领导下，团委的指导下，结合我院实际情况开展各项活动的学生组织，2008年成立至今，本着“全心全意为同学服务”的宗旨，进行公开化、透明化、制度化的工作，是联系学院与同学们的桥梁和纽带，是我院各项活动的主要策划、组织者，也是维护同学权益的组织，在我们的自身的发展与建设中，我院学生会各方面的制度不断在实践中完善，管理经验有很大提高。自成立以来，学生会在院团委的支持关心下，结合学院实际情况，开展了大学生校园歌手大赛、辩论赛、空盘活动、感恩母亲活动、祭扫烈士陵园、篮球赛、拔河比赛、游园会、主持人大赛、讲故事大赛、周末影院等一系列丰富多彩的校园文化活动。', 6, '', 1),
