(81, '重庆航天职业技术学院', '重庆航天职业技术学院团委学生会是在重庆航天职业技术学院党委领导和校团委指导下的大学生群众性自治组织，遵守校训“严慎细实，诚勇勤和“。深入贯彻航天精神：自力更生，艰苦奋斗，大力协同，无私奉献，严谨务实，勇于攀登”。团结带领广大同学努力学习，开拓进取，成为素质全面、适应社会主义现代化建设需要的优秀人才。重庆航天职业技术团委学生会下设：主席团、办公室、宿管部、宣传部、文娱部、外联部、设备部、体育部、素拓部、新闻部、广播站、组织部、社团部、纪检部。学生会来自于同学、服务于同学。它以思想引领为先导、以服务同学为重要内容，以提升同学综合素质为主线，以维护同学权益为突破，是联系学生与学校的桥梁和纽带，是发展与繁荣校园文化的舞台和基地，是服务大学生全面成才的重要载体。这里也是让每一位同学发挥聪明才智、展示自我、释放青春活力的炫色舞台；是同学们共叙友谊、共谋发展、共创辉煌的大家庭。', 1, 'http://redrock.u.qiniudn.com/2015-10-09_5617d7dc632c8.jpg?imageView2/0/w/1400', 1);
