(1, 166, '学姐，一直都很佩服你哦*^_^*，作为''主席团中唯一一名女性，你有着不输于男儿的魄力和决断，又有着女子的温婉睿智，你是西大女生的骄傲^ω^', '2015-10-03', 57, 0, 1, 2),
